INSERT INTO `courses` (`id`, `title`, `link`, `document`, `content`, `tags`, `uid`, `views`, `created`, `modified`) VALUES
(1, 'Course 1', 'course-1', 'http://localhost/mCode/data/documents/2.php', '<p>Nguồn: <a href=\"https://www.topcoder.com/community/data-science/data-science-tutorials/dynamic-programming-from-novice-to-advanced/\">Topcoder</a>.</p>\n\n<p>Có rất nhiều bài toán được áp dụng <strong>quy hoạch động (QHĐ)</strong> (<strong>Dynamic Programming</strong>). QHĐ là một trong những kĩ thuật quan trọng. Bài viết này sẽ giúp bạn hiểu được <strong>QHĐ</strong> thông qua các ví dụ cụ thể.</p>\n\n<p>Note: Trong bài này có thể có nhiều phần bạn đã biết, bạn hoàn toàn có thể chuyển qua đọc phần khác.</p>\n\n<h1><a class=\"anchor\" id=\"beginner\" href=\"#beginner\"><i class=\"fa fa-link\"></i></a>Beginner</h1>\n\n<h2><a class=\"anchor\" id=\"beginner_qhĐ-là-gì\" href=\"#beginner_qhĐ-là-gì\"><i class=\"fa fa-link\"></i></a>QHĐ là gì ?</h2>\n\n<p><strong>QHĐ</strong> là kĩ thuật được được dùng khi có một công thức và một (hoặc một vài) trạng thái bắt đầu. Một bài toán được tính bởi các bài toán nhỏ hơn đã tìm ra trước đó. <strong>QHĐ</strong> có độ phức tạp đa thức nên sẽ chạy nhanh hơn quay lui và duyệt trâu.</p>\n\n<p>Để hiểu rõ hơn hãy xem ví dụ sau:</p>\n\n<blockquote>\n  <p>Cho <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-1-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>N</mi></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-1\" role=\"math\" style=\"width: 1.15em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 0.932em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.369em 1000.93em 2.352em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-2\"><span class=\"mi\" id=\"MathJax-Span-3\" style=\"font-family: MathJax_Math-italic;\">N<span style=\"display: inline-block; overflow: hidden; h