nt-family: MathJax_Math-italic;\">f<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.057em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-221\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mn\" id=\"MathJax-Span-222\" style=\"font-family: MathJax_Main;\">3</span><span class=\"mo\" id=\"MathJax-Span-223\" style=\"font-family: MathJax_Main;\">]</span><span class=\"mo\" id=\"MathJax-Span-224\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">=</span><span class=\"mn\" id=\"MathJax-Span-225\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">1</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.397em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 1.337em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>f</mi><mo stretchy=\"false\">[</mo><mn>3</mn><mo stretchy=\"false\">]</mo><mo>=</mo><mn>1</mn></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-28\">f[3] = 1</script>\nXét tiếp đến tổng 4, rồi đến 11 bằng cách như trên.</p>\n\n<p><strong>Mã giả:</strong></p>\n\n<pre><code>Gán Min[i] bằng dương vô cùng với mọi i\nMin[0]=0\n\nFor i = 1 to S\nFor j = 0 to N - 1\n   If (Vj&lt;=i AND Min[i-Vj]+1&lt;Min[i])\nThen Min[i]=Min[i-Vj]+1\nOutput Min[S]\n</code></pre>\n\n<p>Đây là lời giải cho tất cả các tổng:</p>\n\n<table width=\"400\" cellspacing=\"0\" cellpadding=\"5\" class=\"formFrame\" align=\"center\">\n	<tbody>\n		<tr>\n			<td nowrap=\"nowrap\">Tổng</td>\n			<td nowrap=\"nowrap\">Lượng xu nhỏ nhất</td>\n			<td nowrap=\"nowrap\">Xu được chọn<br>\n				(tổng còn lại)</td>\n		</tr>\n		<tr>\n			<td>0</td>\n			<td>0</td>\n			<td>-</td>\n		</tr>\n		<tr>\n			<td>1</td>\n			<td>1</td>\n			<td>1 (0)</td>\n		</tr>\n		<tr>\n			<td>2</td>\n			<td>2</td>\n			<td>1 (1)</td>\n		</tr>\n		<tr>\n			<td>3</td>\n			<td>1</td>\n			<td>3 (0)</td>\n		</tr>\n		<tr>\n			<td>4</td>\n			<td>2</td>\n			<td>1 (3)</td>\n		</tr>\n		<tr>\n			<td>5</td>\n			<td>1</td>\n			<td>5 (0)</td>\n		</tr>\n		<tr>\n			<td>6</td>\n			<td>2</td>\n			<td>3 (3)</td>\n		</tr>\n		<tr>\n			<td>7</td>\n			<td>3</td>\n			<td>1 (6)</td>\n		</tr>\n		<tr>\n			<td>8</td>\n			<td>2</td>\n			<td>3 (5)</td>\n		</tr>\n		<tr>\n			<td>9</td>\n			<td>3</td>\n			<td>1 (8)</td>\n		</tr>\n		<tr>\n			<td>10</td>\n			<td>2</td>\n			<td>5 (5)</td>\n		</tr>\n		<tr>\n			<td>11</td>\n			<td>3</td>\n			<td>1 (10)</td>\n		</tr>\n	</tbody>\n</table>\n\n<p>Vậy là chúng ta đã tìm được lời giải cho 3 đồng xu tổng bằng 11.\nDựa vào bảng trên, ta có thể truy vết lại được những đồng xu nào được chọn để tối ưu bài toán.\nBài QHĐ trên còn có một cách tiếp cận khác nữa. Lần này, ta sẽ không tính liên tiếp các tổng. Bắt đầu từ trạng thái 0. Thử nhét đồng xu thứ 1 vào các tổng đã tính. Nếu như tổng <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-29-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>t</mi></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-226\" role=\"math\" style=\"width: 0.495em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 0.385em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.423em 1000.33em 2.352em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-227\"><span class=\"mi\" id=\"MathJax-Span-228\" style=\"font-family: MathJax_Math-italic;\">t</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.063em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 0.937em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>t</mi></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-29\">t</script> có số đồng xu ít hơn số đồng xu hiện tại thì tiến hành cập nhật. Rồi tiếp tục thử với đồng thứ 2, 3 cho đến khi thử hết các đồng. Ví dụ, nhét đồng 1 (giá trị 1) vào tổng 0 ta có tổng 1. Vì ta chưa tính tổng 1 nên <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-30-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>S</mi><mo stretchy=&quot;false&quot;>[</mo><mn>1</mn><mo stretchy=&quot;false&quot;>]</mo><mo>=</mo><mn>1</mn></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-229\" role=\"math\" style=\"width: 4.374em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 3.555em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.26em 1003.5em 2.626em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-230\"><span class=\"mi\" id=\"MathJax-Span-231\" style=\"font-family: MathJax_Math-italic;\">S<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.057em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-232\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mn\" id=\"MathJax-Span-233\" style=\"font-family: MathJax_Main;\">1</span><span class=\"mo\" id=\"MathJax-Span-234\" style=\"font-family: MathJax_Main;\">]</span><span class=\"mo\" id=\"MathJax-Span-235\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">=</span><span class=\"mn\" id=\"MathJax-Span-236\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">1</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span