</span></span><span class=\"mo\" id=\"MathJax-Span-357\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">≤</span><span class=\"mn\" id=\"MathJax-Span-358\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">1000</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.263em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 1.137em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>N</mi><mo>≤</mo><mn>1000</mn></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-45\">N \\le  1000</script>) và các cạnh có trọng số dương. Tìm đường đi ngắn nhất từ đỉnh 1 đến đỉnh <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-46-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>N</mi></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-359\" role=\"math\" style=\"width: 1.15em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 0.932em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.369em 1000.93em 2.352em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-360\"><span class=\"mi\" id=\"MathJax-Span-361\" style=\"font-family: MathJax_Math-italic;\">N<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.112em;\"></span></span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.063em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 0.937em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>N</mi></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-46\">N</script> hoặc thông báo không tồn tại đường đi.\nGợi ý: Tại mỗi bước, chọn ra trong số các đỉnh chưa thăm mà có đường đi từ 1, chọn ra đỉnh có đường đi ngắn nhất.</p>\n\n<p><strong>Các bài ví dụ khác:</strong></p>\n\n<ul>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4493&amp;pm=1259\">ZigZag</a> – 2003 TCCC Semifinals 3.</li>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5009&amp;pm=2402\">BadNeighbors</a> – 2004 TCCC Round 4.</li>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5006&amp;pm=1918\">FlowerGarden</a> – 2004 TCCC Round 1.</li>\n</ul>\n\n<h1><a class=\"anchor\" id=\"intermediate\" href=\"#intermediate\"><i class=\"fa fa-link\"></i></a>Intermediate</h1>\n\n<p>Tới đây bạn sẽ được làm quen với QHĐ 2 chiều.</p>\n\n<p><strong>Bài toán:</strong>\nCho một bảng <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-47-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>M</mi><mo>&amp;#x2217;</mo><mi>N</mi></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-362\" role=\"math\" style=\"width: 3.555em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 2.899em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.369em 1002.9em 2.352em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-363\"><span class=\"mi\" id=\"MathJax-Span-364\" style=\"font-family: MathJax_Math-italic;\">M<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.057em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-365\" style=\"font-family: MathJax_Main; padding-left: 0.221em;\">∗</span><span class=\"mi\" id=\"MathJax-Span-366\" style=\"font-family: MathJax_Math-italic; padding-left: 0.221em;\">N<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.112em;\"></span></span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.063em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 0.937em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>M</mi><mo>∗</mo><mi>N</mi></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-47\">M * N</script>, mỗi ô có một lượng táo. Bắt đầu từ ô trái trên, mỗi bước có thể đi sang phải hoặc xuống dưới. Bạn có thể ăn được nhiều nhất bao nhiêu quả táo ?</p>\n\n<p>Cách giải bài này cũng tương tự như những bài trước.</p>\n\n<p>Đầu tiên là phải xác định trạng thái là gì. Ở mỗi ô có nhiều nhất 2 cách có thể tới được ô đó, từ ô bên trái và ô phía trên. Do vậy, để tìm trạng thái hiện tại, ta phải tính trước các ô có thể đến được nó.</p>\n\n<p>Ta có công thức truy hồi sau:\n<span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-48-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>S</mi><mo stretchy=&quot;false&quot;>[</mo><mi>i</mi><mo stretchy=&quot;false&quot;>]</mo><mo stretchy=&quot;false&quot;>[</mo><mi>j</mi><mo stretchy=&quot;false&quot;>]</mo><mo>=</mo><mi>A</mi><mo stretchy=&quot;false&quot;>[</mo><mi>i</mi><mo stretchy=&quot;false&quot;>]</mo><mo stretchy=&quot;false&quot;>[</mo><mi>j</mi><mo stretchy=&quot;false&quot;>]</mo><mo>+</mo><mi>m</mi><mi>a</mi><mi>x</mi><mo stretchy=&quot;false&quot;>(</mo><mi>S</mi><mo stretchy=&quot;false&quot;>[</mo><mi>i</mi><mo>&amp;#x2212;</mo><mn>1</mn><mo stretchy=&qu