n class=\"mi\" id=\"MathJax-Span-537\" style=\"font-family: MathJax_Math-italic;\">i</span><span class=\"mi\" id=\"MathJax-Span-538\" style=\"font-family: MathJax_Math-italic;\">n</span><span class=\"mo\" id=\"MathJax-Span-539\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mi\" id=\"MathJax-Span-540\" style=\"font-family: MathJax_Math-italic;\">N<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.112em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-541\" style=\"font-family: MathJax_Main;\">]</span><span class=\"mo\" id=\"MathJax-Span-542\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mi\" id=\"MathJax-Span-543\" style=\"font-family: MathJax_Math-italic;\">j</span><span class=\"mo\" id=\"MathJax-Span-544\" style=\"font-family: MathJax_Main;\">]</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.397em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 1.337em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>M</mi><mi>i</mi><mi>n</mi><mo stretchy=\"false\">[</mo><mi>N</mi><mo stretchy=\"false\">]</mo><mo stretchy=\"false\">[</mo><mi>j</mi><mo stretchy=\"false\">]</mo></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-71\">Min[N][j]</script> có giá trị nhỏ nhất (và <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-72-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>j</mi></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-545\" role=\"math\" style=\"width: 0.549em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 0.44em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.369em 1000.44em 2.571em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-546\"><span class=\"mi\" id=\"MathJax-Span-547\" style=\"font-family: MathJax_Math-italic;\">j</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.33em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 1.203em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>j</mi></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-72\">j</script> lớn nhất trong số các <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-73-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>M</mi><mi>i</mi><mi>n</mi><mo stretchy=&quot;false&quot;>[</mo><mi>N</mi><mo stretchy=&quot;false&quot;>]</mo><mo stretchy=&quot;false&quot;>[</mo><mi>j</mi><mo stretchy=&quot;false&quot;>]</mo></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-548\" role=\"math\" style=\"width: 5.413em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 4.429em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.26em 1004.32em 2.626em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-549\"><span class=\"mi\" id=\"MathJax-Span-550\" style=\"font-family: MathJax_Math-italic;\">M<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.057em;\"></span></span><span class=\"mi\" id=\"MathJax-Span-551\" style=\"font-family: MathJax_Math-italic;\">i</span><span class=\"mi\" id=\"MathJax-Span-552\" style=\"font-family: MathJax_Math-italic;\">n</span><span class=\"mo\" id=\"MathJax-Span-553\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mi\" id=\"MathJax-Span-554\" style=\"font-family: MathJax_Math-italic;\">N<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.112em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-555\" style=\"font-family: MathJax_Main;\">]</span><span class=\"mo\" id=\"MathJax-Span-556\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mi\" id=\"MathJax-Span-557\" style=\"font-family: MathJax_Math-italic;\">j</span><span class=\"mo\" id=\"MathJax-Span-558\" style=\"font-family: MathJax_Main;\">]</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.397em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 1.337em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>M</mi><mi>i</mi><mi>n</mi><mo stretchy=\"false\">[</mo><mi>N</mi><mo stretchy=\"false\">]</mo><mo stretchy=\"false\">[</mo><mi>j</mi><mo stretchy=\"false\">]</mo></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-73\">Min[N][j]</script> có cùng giá trị).</p>\n\n<p><strong>Mã giả:</strong></p>\n\n<pre><code>Gán mọi(i,j) là chưa thăm\nGán Min[i][j] bằng dương vô cùng với mọi (i,j)\n\nMin[0][M]=0\n\nWhile(TRUE)\n\n    Trong số những trạng thái chưa thăm (i,j) tìm cái có Min[i][j]\n    nhỏ nhất. Giải sử nó là (k,l).\n\n    Nếu không tìm được (k,l) nào mà Min[k][l] nhỏ hơn dương vô cùng - thoát vòng lặp.\n\n    Đánh dấu (k,l) đã thăm\n\n    For All Neighbors p of Vertex k.\n       If (l-S[p]&gt;=0 AND\n        Min[p][l-S[p]]&gt;Min[k][l]+Dist[k][p])\n          Then Min[p][l-S[p]]=Min[k][l]+Dist[k][p]\n       i.e.\n    Nếu tại (i,j) có đủ tiền để đi qua p (l-S[p] là số tiền còn lại sau khi đi qua p), và đường đi ngắn nhất của (p,l-S[p]) lớn hơn [đường đi ngắn nhất tới (k,l)] + [khoảng cách từ k tới p)],\n    thì gán (i,j) bằn tổng này.\n    End For\n\nEnd While\n\nTìm số nhỏ nhất trong các Min[N-1][j] (for all j, 0&lt;=j&lt;=M);\nNếu có nhiều hơn một trạng thái, lấy trạng thái nào có j lớn nhất. Nếu không có (N-1,j) nào nhỏ hơn dương vô cùng - không tồn tại đường đi.\n</code></pre>\n\n<p><strong>Các bài luyện tập:</strong></p>\n\n<ul>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4705&amp;pm=1166\">Jewelry</a> – 2003 TCO Online Round 4</li>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4555&amp;pm=1215\">StripePainter</a> – SRM 150 Div 1</li>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5072&amp;pm=2829\">QuickSums</a> – SRM 197 Div 2</li>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4630&amp;pm=1861\">ShortPalindromes</a> – SRM 165 Div 2</li>\n</ul>\n\n<h1><a class=\"anchor\" id=\"advanced\" href=\"#advanced\"><i class=\"fa fa-link\"></i></a>Advanced</h1>\n\n<p>Những bài sau đây sẽ cần một chút kĩ năng phân tích để có thể tối ưu chúng thành bài QHĐ.</p>\n\n<p><strong>Problem <a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5854&amp;pm=2940\">StarAdventure</a> – SRM 208 Div 1:</strong></p>\n\n<p>Cho ma trận M hàng, N cột (<span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-74-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>N</mi><mo>&amp;#x2217;</mo><mi>M</mi></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-559\" role=\"math\" style=\"width: 3.555em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 2.899em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.369em 1002.9em 2.352em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-560\"><span class=\"mi\" id=\"MathJax-Span-561\" style=\"font-family: MathJax_Math-italic;\">N<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.112em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-562\" style=\"font-family: MathJax_Main; padding-left: 0.221em;\">∗</span><span class=\"mi\" id=\"MathJax-Span-563\" style=\"font-family: MathJax_Math-italic; padding-left: 0.221em;\">M<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.057em;\"></span></span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.063em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 0.937em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mi>N</mi><mo>∗</mo><mi>M</mi></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-74\">N * M</script>). Mỗi ô có một lượng táo.\nBạn đang ở ô góc trái trên. Bạn chỉ có thể đi xuống hoặc sang phải. Bạn cần tới ô góc phải dưới. Rồi quay lại ô trái trên bằng cách lên hoặc sang trái. Cuối cùng, bạn quay lại ô phải dưới.\nTìm số táo nhiều nhất mà bạn có thể ăn được.\nKhi đi qua một ô, toàn bộ táo của ô đấy sẽ bị ăn hết.</p>\n\n<p>Giới hạn: <span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-75-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mn>1</mn><mo>&amp;lt;</mo><mi>N</mi><mo>,</mo><mi>M</mi><mo>&amp;#x2264;</mo><mn>50</mn></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-564\" role=\"math\" style=\"width: 8.036em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 6.56em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.369em 1006.5em 2.571em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-565\"><span class=\"mn\" id=\"MathJax-Span-566\" style=\"font-family: MathJax_Main;\">1</span><span class=\"mo\" id=\"MathJax-Span-567\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">&lt;</span><span class=\"mi\" id=\"MathJax-Span-568\" style=\"font-family: MathJax_Math-italic; padding-left: 0.276em;\">N<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.112em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-569\" style=\"font-family: MathJax_Main;\">,</span><span class=\"mi\" id=\"MathJax-Span-570\" style=\"font-family: MathJax_Math-italic; padding-left: 0.167em;\">M<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.057em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-571\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">≤</span><span class=\"mn\" id=\"MathJax-Span-572\" style=\"font-family: MathJax_Main; padding-left: 0.276em;\">50</span></span><span style=\"display: inline-block; width: 0px; height: 2.189em;\"></span></span></span><span style=\"display: inline-block; overflow: hidden; vertical-align: -0.33em; border-left-width: 0px; border-left-style: solid; width: 0px; height: 1.203em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mn>1</mn><mo>&lt;</mo><mi>N</mi><mo>,</mo><mi>M</mi><mo>≤</mo><mn>50</mn></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-75\">1 < N, M \\le 50</script> mỗi ô có từ 0 đến 1000 quả táo.</p>\n\n<p>Đọc đến đây, hẳn bạn sẽ thấy cái đề này quen quen, nó chính là bài mở rộng của bài toán phần Intermediate. Ta có thể thử đưa bài toán này về thành bài toán trên. Để ý thấy đường đi từ ô góc phải dưới lên trái trên cũng có thể coi là một đường đi từ góc trái trên xuống. Như vậy, chúng ta phải xử lý bài toán với 3 đường đi từ trái trên xuống. Gọi 3 đường này là trái, giữa và phải. Khi 2 đường giao nhau (như hình dưới):</p>\n\n<p><img src=\"https://www.topcoder.com/i/education/dynProg_1.gif\" alt=\"enter image description here\"></p>\n\n<p>thì nó cũng tương đương với hình sau:</p>\n\n<p><img src=\"https://www.topcoder.com/i/education/dynProg_2.gif\" alt=\"enter image description here\"></p>\n\n<p>Bằng cách này, chúng ta đã có một cái nhìn khác về bài toán. Các đường này sẽ không giao nhau (trừ ô góc trái trên và phải dưới). Với mỗi hàng y (không phải hàng đầu và cuối), tọa độ x ở mỗi đường sẽ là (<span class=\"MathJax_Preview\" style=\"color: inherit;\"></span><span class=\"MathJax\" id=\"MathJax-Element-76-Frame\" tabindex=\"0\" data-mathml=\"<math xmlns=&quot;http://www.w3.org/1998/Math/MathML&quot;><mi>x</mi><mn>1</mn><mo stretchy=&quot;false&quot;>[</mo><mi>y</mi><mo stretchy=&quot;false&quot;>]</mo></math>\" role=\"presentation\" style=\"position: relative;\"><nobr aria-hidden=\"true\"><span class=\"math\" id=\"MathJax-Span-573\" role=\"math\" style=\"width: 2.626em; display: inline-block;\"><span style=\"display: inline-block; position: relative; width: 2.134em; height: 0px; font-size: 122%;\"><span style=\"position: absolute; clip: rect(1.26em 1002.02em 2.626em -999.997em); top: -2.183em; left: 0.003em;\"><span class=\"mrow\" id=\"MathJax-Span-574\"><span class=\"mi\" id=\"MathJax-Span-575\" style=\"font-family: MathJax_Math-italic;\">x</span><span class=\"mn\" id=\"MathJax-Span-576\" style=\"font-family: MathJax_Main;\">1</span><span class=\"mo\" id=\"MathJax-Span-577\" style=\"font-family: MathJax_Main;\">[</span><span class=\"mi\" id=\"MathJax-Span-578\" style=\"font-family: MathJax_Math-italic;\">y<span style=\"display: inline-block; overflow: hidden; height: 1px; width: 0.003em;\"></span></span><span class=\"mo\" id=\"MathJax-Span-579\" style=\"font-family: MathJax_Main;\">]</span></span><span style=\"display: 