x; border-left-style: solid; width: 0px; height: 1.337em;\"></span></span></nobr><span class=\"MJX_Assistive_MathML\" role=\"presentation\"><math xmlns=\"http://www.w3.org/1998/Math/MathML\"><mo stretchy=\"false\">(</mo><mi>y</mi><mo>,</mo><mi>k</mi><mo stretchy=\"false\">)</mo></math></span></span><script type=\"math/tex\" id=\"MathJax-Element-93\">(y,k)</script>. Vì chúng ta đang đi xuống. Sau đó, chúng ta xét đến những đường có thể sang phải. Để tránh việc giao nhau, ta xét lần lượt các bước ở trái, phải rồi giữa.</p>\n\n<p><strong>Bài luyện tập thêm:</strong></p>\n\n<ul>\n  <li>\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4710&amp;pm=1996\">MiniPaint</a> – SRM 178 Div 1</li>\n</ul>\n\n<p><strong>Note:</strong>\nKhi gặp một bài toán, hãy để ý xem nó có được giải trong thời gian đa thức không. Nếu có, thử xác định trạng thái của nó, cách chuyển trạng thái, và nếu không chuyển được trạng thái, hãy thử tối ưu nó về một bài QHĐ (như ví dụ ở trên).</p>\n\n<p><strong>Những bài đã đề cập ở trên:</strong></p>\n\n<ul>\n  <li>TCCC ’03 Semifinals 3 Div I Easy –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4493&amp;pm=1259\">ZigZag</a>\n</li>\n  <li>TCCC ’04 Round 4 Div I Easy –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5009&amp;pm=2402\">BadNeighbors</a>\n</li>\n  <li>TCCC ’04 Round 1 Div I Med –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5006&amp;pm=1918\">FlowerGarden</a>\n</li>\n  <li>TCO ’03 Semifinals 4 Div I Easy –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4709&amp;pm=1889\">AvoidRoads</a>\n</li>\n  <li>TCCC ’03 Round 4 Div I Easy –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4482&amp;pm=1592\">ChessMetric</a>\n</li>\n  <li>TCO ’03 Round 4 Div I Med –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4705&amp;pm=1166\">Jewelry</a>\n</li>\n  <li>SRM 150 Div I Med –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4555&amp;pm=1215\">StripePainter</a>\n</li>\n  <li>SRM 197 Div II Hard –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5072&amp;pm=2829\">QuickSums</a>\n</li>\n  <li>SRM 165 Div II Hard –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4630&amp;pm=1861\">ShortPalindromes</a>\n</li>\n  <li>SRM 208 Div I Hard –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=5854&amp;pm=2940\">StarAdventure</a>\n</li>\n  <li>SRM 178 Div I Hard –\n<a href=\"http://community.topcoder.com/tc?module=ProblemDetail&amp;rd=4710&amp;pm=1996\">MiniPaint</a>\n</li>\n</ul>', '', 1, 0, '2014-06-01 00:35:07', '2014-05-31 13:34:33');
INSERT INTO `courses` (`id`, `title`, `link`, `document`, `content`, `tags`, `uid`, `views`, `created`, `modified`) VALUES
(2, 'Electronics', 'electronics', '', 'Shit', '', 1, 0, '2014-06-01 00:35:07', '2014-05-31 13:34:33'),
(3, 'Motors', 'motors', '', '<span style=\"color:#f00\">[Only admins are allowed to see this link]</span><blockquote><div><cite><span style=\"color:#f00\">[Only admins are allowed to see this link]</span> wrote:</cite>Ngoài Việt hóa vài chỗ ra thì không có phần nào bạn viết sài được.  :v <br>Phần cộng point không liên quan gì đến kết quả chơi game, vào là cộng, cũng không hề xét điều kiện lỗi.  :fb88: <br>Có mưu đồ chèn iframe bất chính.  -_- <br><br>Để giải quyết phần tính điểm thì cách đơn giản nhất là dò trong code, phần thông báo victory, chèn code cộng point vào, tốt nhất là tạo một function đặt ở đấy, rồi tạo file khác viết code tính điểm , nếu không lúc cần sửa lại dò trong 15k dòng code cũng phiền. :D</div></blockquote><br>Đâu có đâu. Phải chơi rồi nhấn vào qua màn mới được cộng chứ. Mình thiết đặt như thế để cho dễ mà. Chứ nếu không phải sửa lại css toàn bộ cực lắm. Vì nếu viết trực tiếp vào trang html chính thì như vậy các css của game sẽ xung đột với css của forum, vì theo mình biết để ajax hoạt động hình như là phải để dùng header and footer của forum. Nếu để game vào đó thì lỗi mất.<br><br>Mình chèn iframe cũng để làm giao tiếp post thôi. Cũng đâu có chèn link của mình vào đâu.<br>Mình lợi dụng các button qua màn trong game để làm thôi. Đơn giản khỏi dò tìm chi cho mệt. Game này bên forum mình làm chỉ có chơi qua màn mới tính điểm thôi. Không tin baivong có thể qua test một chút là biết ngay ấy mà.', '', 1, 0, '2014-06-01 00:35:07', '2014-05-31 13:34:54');

