INSERT INTO `test` (`id`, `title`, `link`, `content`, `stt`, `pid`, `uid`, `views`, `time`, `start`, `created`, `modified`) VALUES
(1, 'Test 1', 'test-1', 'Here\'s the test description~', 1, '1,2,17', 1, 0, 90, '2016-07-26 04:36:15', '2014-06-01 00:35:07', '2014-05-31 13:34:33'),
(2, 'Electronics', 'electronics', 'Shit', 0, '1', 1, 0, 45, '2016-07-26 04:36:15', '2014-06-01 00:35:07', '2014-05-31 13:34:33'),
(3, 'Motors', 'motors', '<span style=\"color:#f00\">[Only admins are allowed to see this link]</span><blockquote><div><cite><span style=\"color:#f00\">[Only admins are allowed to see this link]</span> wrote:</cite>Ngoài Việt hóa vài chỗ ra thì không có phần nào bạn viết sài được.  :v <br>Phần cộng point không liên quan gì đến kết quả chơi game, vào là cộng, cũng không hề xét điều kiện lỗi.  :fb88: <br>Có mưu đồ chèn iframe bất chính.  -_- <br><br>Để giải quyết phần tính điểm thì cách đơn giản nhất là dò trong code, phần thông báo victory, chèn code cộng point vào, tốt nhất là tạo một function đặt ở đấy, rồi tạo file khác viết code tính điểm , nếu không lúc cần sửa lại dò trong 15k dòng code cũng phiền. :D</div></blockquote><br>Đâu có đâu. Phải chơi rồi nhấn vào qua màn mới được cộng chứ. Mình thiết đặt như thế để cho dễ mà. Chứ nếu không phải sửa lại css toàn bộ cực lắm. Vì nếu viết trực tiếp vào trang html chính thì như vậy các css của game sẽ xung đột với css của forum, vì theo mình biết để ajax hoạt động hình như là phải để dùng header and footer của forum. Nếu để game vào đó thì lỗi mất.<br><br>Mình chèn iframe cũng để làm giao tiếp post thôi. Cũng đâu có chèn link của mình vào đâu.<br>Mình lợi dụng các button qua màn trong game để làm thôi. Đơn giản khỏi dò tìm chi cho mệt. Game này bên forum mình làm chỉ có chơi qua màn mới tính điểm thôi. Không tin baivong có thể qua test một chút là biết ngay ấy mà.', -1, '1', 1, 0, 120, '2016-07-26 04:36:15', '2014-06-01 00:35:07', '2014-05-31 13:34:54');

